(263, 143, 26, 0, 9, 0, 69, 0, 0, 0, 'December 06, 2015, Guwahati\n\nRespected Sir,\n\nI am a common citizen of Assam. I am 35 years of age and till date I have witnessed 8 to 10 LokSabha and Vidhansabha elections. The 2016 Vidhan Sabha elections are around the corner and almost all political parties are promising employment. Please do something for the employment of Assamese youth.\n\nArun Sharma', '2016-01-29 08:18:05', '0000-00-00 00:00:00', 26.2006, 92.9376, 'C', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 0, '2016-02-03 13:40:08', '0', 'Unemployment scenario in Assam', 'assam', NULL),
