(15, 16, 'Brijmohan Agrawal-Best Leader Ever', 'ENG', '<span style=\"color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 13px; font-s', '<span style=\"color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 1; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none; background-color: rgb(255, 255, 255);\">Mr. Brijmohan Agrawal, an Indian politician and member of the Bharatiya Janata Party (BJP), is a cabinet minister for education in the state of Chhattisgarh. He also heads the ministries of Legislative Affairs, School Education, Culture, and Endowment, other than Tourism Departments and the Public Works Department.</span><br style=\"color: rgb(51, 51, 51); font-family: Roboto, arial, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 17px; orphans: auto; text-align: start; text-ind', 'https://www.youtube.com/watch?v=-Iu_DiwQnIk', 'Youtube URL', 1, '2015-09-14 07:42:15', '0000-00-00 00:00:00'),
