(157, 50, 'Flower Exhibition', 'ENG', '<div style=\"text-align: center;\"><span style=\"margin: 0px; padding: 0px; font-family: &quot;Open San', '<p style=\"margin: 0px 0px 15px; padding: 0px; text-align: justify; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.</p><p style=\"margin: 0px 0px 15px; padding: 0px; text-alig', '1562997446-cmgallery.jpg', 'Image', 1, '2019-12-19 07:24:20', '2019-07-01 11:25:00'),
(158, 50, 'Exhibit Design', 'ENG', '<span style=\"font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">An&nbs', '<p style=\"margin: 0.5em 0px; font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">The exhibit design process builds on a conceptual or&nbsp;<a href=\"https://en.wikipedia.org/wiki/Interpretive_planning\" title=\"Interpretive planning\" style=\"text-decoration-line: none; background: none;\">i</a><a href=\"https://en.wikipedia.org/wiki/Interpretive_planning\" title=\"Interpretive planning\" style=\"text-decoration-line: none; background: none;\">nterpretive plan</a>&nbsp;for an exhibit, determining the most effective, engaging and appropriate methods of communicating a message or telling a story. The process will often mirror the architectural process or schedule, moving from conceptual plan, through schematic design, design development, contract document, fabrication, and installation. The first phases establish a thematic direction and develop creative and appropriate design solutions to achieve the interpretive and communication goals of the exhibit. The latter phases', '1562997598-cmgallery.jpeg', 'Image', 1, '2019-12-19 07:33:10', '2019-07-01 11:27:00'),
(159, 50, 'United Yojana', 'ENG', '<p style=\"box-sizing: border-box; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px; b', '<p style=\"box-sizing: border-box; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255); line-height: 24px !important; padding: 2px 0px !important; margin: 0px 0px 12px !important;\">&nbsp;<span style=\"white-space:pre\">	</span>Addressing the Independence Day function at the 1st Manipur Rifles ground here, Singh said, \"A prosperous and progressive society can be achieved only when its people stay united. They should work together to ensure that development is not affected due to unwanted misunderstandings.\"<br style=\"box-sizing: border-box; margin: 0px; padding: 0px; height: 0px !important;\"><span style=\"white-space:pre\">	</span>Talking about the initiatives taken by his government for the welfare of Manipur, the CM said work was in progress to develop Tamenglong into a district.</p><p style=\"box-sizing: border-box; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255); line-height: 24px !impo', '1563104252-cmgallery.jpg', 'Image', 1, '2019-12-19 07:44:12', '2019-07-02 17:04:00'),
(160, 50, 'Furnishing fairs', 'ENG', '<p style=\"box-sizing: border-box; margin: 0.85em 0px; padding: 0px; border: 0px rgb(235, 235, 235); ', '<div style=\"text-align: left;\"><p style=\"box-sizing: border-box; -webkit-font-smoothing: initial; -webkit-tap-highlight-color: transparent; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 15px; line-height: 1.75em; font-family: &quot;Source Sans Pro&quot;, Helvetica, sans-serif; vertical-align: baseline; margin: 0px 0px 1.75em; padding: 0px; overflow-wrap: break-word; color: rgb(48, 48, 48); background-color: rgb(255, 255, 255);\">A century on, the compelling idea that&nbsp;<a href=\"https://www.archdaily.com/tag/modern-architecture\" style=\"box-sizing: border-box; -webkit-font-smoothing: inherit; -webkit-tap-highlight-color: transparent; border: 0px; font: inherit; vertical-align: baseline; margin: 0px; padding: 0px; text-decoration-line: none; color: rgb(2, 108, 182);\">Modern architecture</a>&nbsp;emerged like some blindingly white, crystalline and disruptive phoenix from the darkness, death and destruction of the First Wor', '1563104322-cmgallery.jpg', 'Image', 1, '2019-12-19 07:50:43', '2019-07-11 17:06:00'),
(161, 50, 'Swachh Bharat', 'ENG', '<b style=\"color: rgb(34, 34, 34); font-family: sans-serif; font-size: 14px; background-color: rgb(25', '<p style=\"margin: 0.5em 0px; color: rgb(34, 34, 34); font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">The campaign was officially launched on 2 October 2014 at&nbsp;<a href=\"https://en.wikipedia.org/wiki/Raj_Ghat_and_associated_memorials\" title=\"Raj Ghat and associated memorials\" style=\"text-decoration-line: none; color: rgb(11, 0, 128); background: none;\">Rajghat</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/New_Delhi\" title=\"New Delhi\" style=\"text-decoration-line: none; color: rgb(11, 0, 128); background: none;\">New Delhi</a>&nbsp;by Prime Minister&nbsp;<a href=\"https://en.wikipedia.org/wiki/Narendra_Modi\" title=\"Narendra Modi\" style=\"text-decoration-line: none; color: rgb(11, 0, 128); background: none;\">Narendra Modi</a>. It is India\'s largest cleanliness drive to date with three million government employees and students from all parts of India participating in 4,043 cities,towns and rural areas.. Modi has called the campaign&nbsp;<i>Satyagrah se S', '1563104392-cmgallery.jpg', 'Image', 1, '2019-12-19 07:53:12', '2019-07-12 17:07:00'),
(162, 50, 'Vivah Yojana', 'ENG', '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px', '<ul style=\"margin: 0px; padding: 0px; font-family: &quot;Open Sans&quot;, Arial, sans-serif; font-size: 14px; text-align: justify; background-color: rgb(255, 255, 255);\"><li style=\"margin: 0px; padding: 0px;\"><h3 style=\"margin: 15px 0px; padding: 0px; text-align: left; font-size: 14px;\">Section 1.10.33 of \"de Finibus Bonorum et Malorum\", written by Cicero in 45 BC</h3><p style=\"margin: 0px 0px 15px; padding: 0px;\">\"At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident, similique sunt in culpa qui officia deserunt mollitia animi, id est laborum et dolorum fuga. Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil impedit quo minus id quod maxime placeat facere possimus, omnis voluptas assumenda est, omnis dolor repellendus. Temporibus autem quibusdam et aut officiis de', '1563105037-cmgallery.jpg', 'Image', 1, '2019-12-19 07:38:58', '2019-07-08 17:18:00'),
(163, 50, 'Beti Bacho, Beti Padhao', 'ENG', '<b style=\"color: rgb(34, 34, 34); font-family: sans-serif; font-size: 14px; background-color: rgb(25', '<p style=\"margin: 0.5em 0px; color: rgb(34, 34, 34); font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">According to census data in India, the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Child_sex_ratio\" title=\"Child sex ratio\" style=\"text-decoration-line: none; color: rgb(11, 0, 128); background: none;\">child sex ratio</a>&nbsp;(06 years) in India was 927 girls per 1,000 boys in 2001, which dropped to 918&nbsp;girls for every 1,000 boys in 2011. A 2012&nbsp;<a href=\"https://en.wikipedia.org/wiki/UNICEF\" title=\"UNICEF\" style=\"text-decoration-line: none; color: rgb(11, 0, 128); background: none;\">UNICEF</a>&nbsp;report ranked India 41st among 195 countries.&nbsp;In the Population Census of 2011 it was revealed that the population ratio of India 2011 is 919 females per 1000 of males. The Sex Ratio 2011 shows a downward trend from the census 2001 data.</p><p style=\"margin: 0.5em 0px; color: rgb(34, 34, 34); font-family: sans-serif; font-size: 14px; backgroun', '1563105157-cmgallery.jpg', 'Image', 1, '2019-12-19 07:55:38', '2019-06-04 17:19:00'),
(164, 50, 'Tree Plantation', 'ENG', '<b style=\"color: rgb(34, 34, 34); font-family: sans-serif; font-size: 14px; background-color: rgb(25', '<p style=\"margin: 0.5em 0px; color: rgb(34, 34, 34); font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">In&nbsp;<a href=\"https://en.wikipedia.org/wiki/Silviculture\" title=\"Silviculture\" style=\"text-decoration-line: none; color: rgb(11, 0, 128); background: none;\">silviculture</a>&nbsp;the activity is known as&nbsp;<a href=\"https://en.wikipedia.org/wiki/Reforestation\" title=\"Reforestation\" style=\"text-decoration-line: none; color: rgb(11, 0, 128); background: none;\">reforestation</a>, or&nbsp;<a href=\"https://en.wikipedia.org/wiki/Afforestation\" title=\"Afforestation\" style=\"text-decoration-line: none; color: rgb(11, 0, 128); background: none;\">afforestation</a>, depending on whether the area being planted has or has not recently been forested. It involves planting seedlings over an area of land where the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Forest\" title=\"Forest\" style=\"text-decoration-line: none; color: rgb(11, 0, 128); background: none;\">forest</a>', '1563105211-cmgallery.jpg', 'Image', 1, '2019-12-19 07:58:52', '2019-07-13 17:21:00'),
(165, 50, 'Stump Speech', 'ENG', '<span style=\"color: rgb(34, 34, 34); font-family: sans-serif; font-size: 14px; background-color: rgb', '<p style=\"margin: 0.5em 0px; color: rgb(34, 34, 34); font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">In presidential campaigns in the United States, a candidate\'s speech at his or her party\'s&nbsp;<a href=\"https://en.wikipedia.org/wiki/Presidential_nominating_convention\" class=\"mw-redirect\" title=\"Presidential nominating convention\" style=\"text-decoration-line: none; color: rgb(11, 0, 128); background: none;\">presidential nominating convention</a>&nbsp;usually forms the basis for the stump speech for the duration of the national campaign.</p><p style=\"margin: 0.5em 0px; color: rgb(34, 34, 34); font-family: sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">Stump speeches are not meant to generate news, outside of local media covering a candidate\'s appearance. National media usually ignore their contents in their daily news coverage. The predictability of stump speeches gives reporters a general indication that the candidate will soon co', '1563105269-cmgallery.jpg', 'Image', 1, '2019-12-19 08:04:08', '2019-07-07 17:21:00'),
(166, 50, '\'Matters of Urgent Public Importance\'', 'ENG', '<span style=\"color: rgb(13, 13, 13); font-family: Roboto, Arial, sans-serif; font-size: 14px; white-', '<span style=\"color: rgb(13, 13, 13); font-family: Roboto, Arial, sans-serif; font-size: 14px; white-space: pre-wrap; background-color: rgb(249, 249, 249);\">Shri Sunil Baburao Mendhe raising \'Matters of Urgent Public Importance\' in Lok Sabha: 21.11.2019</span>', 'https://www.youtube.com/watch?v=o8wa9HBMDJs', 'Youtube URL', 1, '2019-12-30 08:30:40', '2019-11-21 13:55:00'),
