INSERT INTO `clientinitiatives` (`ClientInitiativeID`, `CMSUserAuthenticationID`, `LanguageCode`, `IntiativeTitle`, `InitiativeText`, `InitiativeBannerImage`, `InitiativeMediaTitle`, `InitiativeMediaPath`, `InitiativeMediaType`, `IsShowntoPublic`, `InitiativeTimeStamp`, `InitiativeDate`) VALUES
(2, 2, 'ENG', 'Rahul Gandhi', '<div>The scion of the Gandhi-Nehru family and the son of Sonia Gandhi and the late Rajiv Gandhi, Rahul Gandhi is the Vice-President of the Indian National Congress (INC) and is their main spokesperson for the 2014 Lok Sabha elections. The 43 year old leader is often considered as the youth icon of Congress, especially after his entrance into politics in 2004, where he contested from Amethi and became a Member of Parliament.</div><div><br></div>', '1435737432-cminitiativeb.jpg', 'Rahul Gandhi Speech', 'https://www.youtube.com/watch?v=qJxfP934u-U', 'Youtube URL', 1, '2015-07-01 07:57:12', '2015-05-05'),
(3, 2, 'ENG', 'Sonia and Rahul Gandhi to mutually decide', 'Elevation of Rahul Gandhi as party chief will be a mutual decision between him and Sonia Gandhi, Congress leader Shakeel Ahmad said on Monday, adding that the party workers are keen to see the Nehru-Gandhi scion take over the reigns of the party.', '1432652922-cminitiativeb.jpg', 'Rahul Gandhi Speech', 'https://www.youtube.com/watch?v=qJxfP934u-U', 'Youtube URL', 1, '0000-00-00 00:00:00', '2015-05-06'),
(4, 2, 'ENG', ' Rahul Gandhi\'s understanding on the land bill', '<div>BJP today termed as \"comprehensive one\" the land bill brought by the party-led NDA government and said Congress vice president Rahul Gandhi\'s understanding on the issue was \"faulty\".</div><div><br></div>', '1432652974-cminitiativeb.png', ' Rahul Gandhi\'s on the land bill', 'https://www.youtube.com/watch?v=qJxfP934u-U', 'Youtube URL', 1, '0000-00-00 00:00:00', '2015-05-06'),
(5, 5, 'ENG', 'Occasion of Swami Vivekanands 152nd birth anniversary', '<div>On the occasion of Swami Vivekanands 152nd birth anniversary, the &nbsp;Ram Krishna Vivekananda Samiti &nbsp;in collaboration with National Service Scheme of Sant Gadge Baba Amravati university (SGBAU),Amravati conducted a rally. On this day special blood donation camp was also organised by the samiti in which number of &nbsp;students took part which were seen so enthusiastic during the blood donation camp.</div><div><br></div>', '1434973109-cminitiativeb.jpg', 'Occasion of Swami Vivekanands 152nd birth anniversary', '1434973109-cminitiativem.jpg', 'Image', 1, '2015-06-22 11:38:29', '2015-06-11'),
(6, 5, 'ENG', 'Occasion of World Environment Day', '<div>On the occasion of World Environment Day and to create awareness about conserving environment the Maharashtra Pollution Control Board (MPCB) and Environment Department, GoM together organized a function at the Yashwantrao Chavan Centre, Mumbai, on June 05 2015. MPCB had announced its new vision 2020 which would focus on an all inclusive eco friendly development which would be implemented very soon.</div><div><br></div>', '1434978389-cminitiativeb.jpg', 'Occasion of World Environment Day', '1434978389-cminitiativem.jpg', 'Image', 1, '2015-06-22 13:06:29', '2015-06-18'),
(7, 5, 'ENG', 'INAUGRATE THE CHIKHALDARA TOURISM FESTIVAL', '<div>I AM GLAD TO INAUGRATE THE CHIKHALDARA TOURISM FESTIVAL.Set around the theme of adventure, the festival boasts of introducing series of exhilarating activities like parasailing, valley crossing, rock climbing, hot air balloon and trekking.</div>', '1434978311-cminitiativeb.jpg', 'INAUGRATE THE CHIKHALDARA TOURISM FESTIVAL', '1434978311-cminitiativem.jpg', 'Image', 1, '2015-06-22 13:05:11', '2015-06-18'),
(8, 5, 'ENG', 'Park development', 'Development of new parks would not only enhance the entire look of our ward but it would also add good health and fun outdoor activities for children.', '1434978699-cminitiativeb.jpg', 'Park', '1434978699-cminitiativem.jpg', 'Image', 1, '2015-06-22 13:11:39', '2015-06-11'),
(9, 8, 'ENG', 'National Highway Projects', 'Pleased to inform that the National Highway Authority of India (NHAI) had already begun work on preparing a detailed project report (DPR) of the ambitious project involving 3,000 crore Rs investment for Ring Road construction.', '1435134576-cminitiativeb.jpg', 'National Highway Projects', 'https://www.youtube.com/watch?v=hs1UotTTFwg', 'Youtube URL', 1, '2015-06-29 13:34:47', '2015-06-11'),
(10, 8, 'ENG', 'Mahasampark Abhiyan has been launched in my constituency', 'Mahasampark Abhiyan has been launched in my constituency .During the campaign, the party members will collect details of the new members  caste, area of interest, Adhar card and Electors Photo Identity Card numbers and detail of bank account under Pradhan Mantri Jan Dhan Yojana.', '1435134754-cminitiativeb.jpg', 'Mahasampark Abhiyan ', '0', '0', 1, '2015-07-13 15:34:28', '2015-06-19'),
(11, 8, 'ENG', 'Inauguration of a fortified police station in Chhattisgarh\'s Sukma', 'I am pleased to inform the inauguration of a fortified police station in Chhattisgarh\'s Sukma.', '1435134935-cminitiativeb.jpg', 'Fortified police station', 'https://www.youtube.com/watch?v=vxn2mE6Hpj0', 'Youtube URL', 1, '2015-08-21 09:23:50', '2015-06-18'),
(12, 13, 'ENG', 'Establishment of IIM, AIIMS & NIPER at Nagpur', 'Thanks to the persistent efforts of Shri Nitin Gadkari, Nagpur can now boast of 3 internationally reputed educational institutions viz. the Indian Institute of Management (IIM), All India Institute of Medical Sciences (AIIMS) &amp; National Institute of Pharmaceutical Education &amp; Research (NIPER). Land has been identified for all these institutions and the work for establishments is expected to start soon.', '1441798046-cminitiativeb.jpg', 'AIIMS & NIPER at Nagpur', 'https://www.youtube.com/watch?v=VPYAZBQlkv8', 'Youtube URL', 1, '2019-06-05 02:45:03', '2015-09-09'),
(14, 13, 'ENG', 'Sports Authority of India (SAI)', 'The Sports Authority of India (SAI) has very limited presence in Maharashtra. Due to the persuasion of Shri Nitin Gadkari the Ministry of Sports &amp; Youth Welfare has agreed to establish a regional centre at Nagpur. The Nagpur Municipal Corporation has initiated a process of handing over 100 acres of land for establishment of the centre, which will enhance the sports infrastructure and training facilities in Nagpur.', '1441798698-cminitiativeb.jpg', 'Sports Authority of India (SAI)', 'https://www.youtube.com/watch?v=mVC2lIohpu8', 'Youtube URL', 1, '2015-09-10 09:04:28', '2015-09-09'),
(15, 13, 'ENG', 'Govt revives Jamghat dam for Nagpur\'s water supply.', 'NAGPUR: After gathering dust for over 15 years, Maharashtra and Madhya Pradesh (MP) governments have revived the Jamghat project, which is vital for meeting water needs of the city in late 2020s. The project is expected to take minimum 10 years for completion. However, this will depend on the initiative shown by local politicians. Water resources ministers of Maharashtra and MP Sunil Tatkare and Jayant Malaiya discussed the project at a meeting held here on Saturday. BJP national president Nitin Gadkari was also present.', '1441979622-cminitiativeb.jpg', 'Jamghat dam', '1441979622-cminitiativem.jpg', 'Image', 1, '2015-09-11 13:53:42', '2014-07-24'),
(16, 13, 'ENG', 'Cargo ports planned at Surat, Wardha, Aurangabad: Gadkari', '<div><div>Mumbai, Aug 16, 2014, PTI:http://www.deccanherald.com/content/425818/cargo-ports-planned-surat-wardha.html&nbsp;</div><div>To reduce dependence on roads for cargo movement and to reduce the costs, JNPT, country\'s largest container port, will be setting up satellite ports at Wardha, Aurangabad and Surat, Shipping Minister Nitin Gadkari said here today. &nbsp;To reduce dependence on roads for cargo movement and to reduce the costs, JNPT, country\'s largest container port, will be setting up satellite ports at Wardha, Aurangabad and Surat, Shipping Minister Nitin Gadkari said here today. Wardha and Aurangabad (both in Maharashtra) will have dry ports from where the cargo will be moved by railway, while at Surat there will be a water port, Gadkari said. He was speaking at a function at the Jawaharlal Nehru Port Trust (JNPT) here in the presence of Prime Minister Narendra Modi who laid foundation stone for an SEZ.</div></div>', '1441981866-cminitiativeb.png', 'Cargo ports planned at Surat, Wardha, Aurangabad', '1441981866-cminitiativem.png', 'Image', 1, '2015-09-14 05:32:45', '2014-06-24'),
(18, 13, 'ENG', 'Nag river rejuvenation project ', 'Source: - timesofindia.indiatimes.com/city/nagpur/Bharti-to-pursue-Nag-river-rejuvenation-project/articleshow/44943159.cms NAGPUR: Union minister of water resources and river development &amp; Ganga rejuvenation Uma Bharti has assured to ensure approval of Nag river rejuvenation project. Datke said MP and union minister Nitin Gadkari had already talked to Bharti about the project. \"Bharti assured to pursue the proposal pending with IIT Roorkee. We hope that the government will approve the project and sanction funds for rejuvenating and conserving the city\'s iconic river,\" he said.', '1441982219-cminitiativeb.jpg', 'Nag river rejuvenation project ', '0', '0', 1, '2015-09-14 05:42:12', '2015-02-07'),
(21, 13, 'ENG', 'Turn waste to wealth, Nitin Gadkari tells cash-strapped civic bodies', 'See more at: http://indianexpress.com/article/cities/delhi/turn-waste-to-wealth-nitin-gadkari-tells-cash-strapped-civic bodies/#sthash.m3sPSCxk.dpuf Union Minister of Road Transport and Highways Nitin Gadkari on Wednesday asked the citys cash strapped municipal corporations to innovate and invest instead of expecting grants from governments. You have to think about how to convert waste to wealth and increase revenue, he said. Gadkari joked that those who do not change with the times do not get votes.', '1441982538-cminitiativeb.jpg', 'Turn waste to wealth, Nitin Gadkari tells cash-strapped civic bodies', '1441982538-cminitiativem.jpg', 'Image', 1, '2015-11-25 06:01:13', '2015-10-27'),
(23, 16, 'ENG', 'Development of the Poor our priority  Brijmohan', '<div>Cheques distributed to 739 beneficiaries,&nbsp;</div><div>Raipur, the state\'s agricultural water resources minister Brij Mohan Agarwal distributed financial Aid &nbsp;from his Shankar Nagar residence to the poor working labourers &nbsp;under the government\'s schemes to aid the poor-working family for the betterment of the public and constantly strive to bring into the mainstream poor-worker siblings.</div><div><br></div>', '1442228563-cminitiativeb.jpg', 'Development of the Poor our priority  Brijmohan', '1442228563-cminitiativem.jpg', 'Image', 1, '2018-01-13 06:14:34', '2015-08-30'),
(24, 16, 'ENG', 'NRI should  partner in the development of Chattisgarh State  Brijmohan', 'During his Canada - USA trip on reaching Washington DC water resources minister Brij Mohan Agarwal Warmly welcomed by Overseas Friends of BJP members and NRIs, during his speech he said.', '1442228673-cminitiativeb.jpg', 'NRI should  partner in the development of Chattisgarh State  Brijmohan', '1442228673-cminitiativem.jpg', 'Image', 1, '2018-02-18 13:13:26', '2015-08-08'),
(25, 16, 'ENG', 'Attended the celebrations of Pola Festival at Ravnbata.', 'Raipurs Pola festival celebrations included Bull-duo race and farmers awardceremony was attended by State Agriculture Minister Brij Mohan Agarwal Addressing the event he said it reflects our bright and glorious culture, today \'s feast our the most important for farmers.', '1442229753-cminitiativeb.jpg', 'Attended the celebrations of Pola Festival at Ravnbata.', '1442229753-cminitiativem.jpg', 'Image', 1, '2018-02-18 13:10:54', '2015-08-19'),
(26, 18, 'ENG', 'Enhancement of facilities and infrastructure at OASES complex, Jaipur', '<div>The state government has decided to rope in acclaimed sportspersons to develop the long-pending Organized Archery, Shooting and Equestrian Sports (OASES) complex in Jagatpura as a centre of excellence.</div><div>&nbsp;</div><div>At a review meeting held by chief minister Vasundhara Raje, suggestions were sought from Olympians Rajyavardhan Singh Rathore, Limba Ram and polo player Adhiraj Singh for enhancement of facilities and infrastructure at OASES.</div><div>&nbsp;</div><div>Rajyavardhan Singh said: \"We have been provided the responsibility to develop the complex as a centre of excellence. The chief minister wanted a self-revenue generating mechanism so that there shall be no financial burden on the players. Also, good accommodation facilities will be provided to the players.\"</div><div>&nbsp;</div><div>After being dumped by Ashok Gehlot government, the OASES complex, a state-of-the-art project initiated by JDA under the previous Raje government, is all set to see light of the day.</div><div>&nbsp;</div><div>The project got a push after the new state government sought a status report and reviewed the project. The previous government, instead of finishing the Rs 100-crore project that commenced in 2007 and managing it professionally, simply turned a blind eye to it. With over Rs 80 crore of public money spent on the OASES project, only 25% of the work was pending when the Gehlot government took over. Since then a lot of water has flown under the bridge.</div>', '1442401064-cminitiativeb.jpg', 'Enhancement of facilities and infrastructure at OASES complex, Jaipur', '1442401064-cminitiativem.jpg', 'Image', 1, '2015-09-23 13:34:55', '2015-09-16'),
(27, 18, 'ENG', 'Spardha-2014 at IIT-BHU', '<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt;\">Spardha-2014, the four-day annual sports extravaganza of IIT-BHU, was\r\ninaugurated by olympian Rajyavardhan Singh Rathore on Thursday. The team\r\ncaptains of all the participating colleges took the oath of sportsmanship and\r\nfair play on the occasion. The inaugural ceremony was followed by a display of\r\nTaekwondo performance. The 29th edition of Spardha was participated by more than\r\n1,500 students from over 40 institutions from different parts of the country.</p>', '1442402814-cminitiativeb.jpg', 'Spardha-2014 at IIT-BHU', '1442402814-cminitiativem.jpg', 'Image', 1, '2015-09-16 11:26:54', '2014-02-03'),
(28, 18, 'ENG', 'Ex-Servicemen Rally in Rewari, Haryana on 15th September, 2013', 'Major Rajyavardhan Singh Rathore speaking in Ex-Servicemen rally for One rank one pension (OROP)', '1442402942-cminitiativeb.jpg', 'Ex-Servicemen Rally in Rewari, Haryana on 15th September, 2013', '1442402942-cminitiativem.jpg', 'Image', 1, '2015-09-23 13:34:01', '2013-09-15'),
(29, 18, 'ENG', 'Interacted with Party Karyakartas at (Phulera and Shahpura constituencies, August 01, 2015', 'Interacted with Party Karyakartas at (Phulera and Shahpura constituencies, August 01, 2015', '1442403035-cminitiativeb.png', 'Interacted with Party Karyakartas at (Phulera and Shahpura constituencies, August 01, 2015', '1442403035-cminitiativem.png', 'Image', 1, '2015-09-23 13:33:37', '2015-08-01'),
(30, 18, 'ENG', 'At Jaipur-Delhi National Highway with NHAI officials on June 23, 2015', 'For developing a friendly NH8 for travelers as well as residents.', '1442403284-cminitiativeb.jpg', 'At Jaipur-Delhi National Highway with NHAI officials on June 23, 2015', '1442403112-cminitiativem.png', 'Image', 1, '2015-11-24 11:39:15', '2015-06-23'),
(31, 18, 'ENG', 'At the District Vigilance & Monitoring committee in Jaipur, June 22, 2015 ', 'At the District Vigilance and Monitoring committee in Jaipur, June 22, 2015 For better synchronizing between administration and people.', '1442403224-cminitiativeb.png', 'At the District Vigilance & Monitoring committee in Jaipur, June 22, 2015 ', '1442403224-cminitiativem.png', 'Image', 1, '2016-01-06 05:43:03', '2015-06-22'),
(32, 23, 'ENG', 'Formation Of New Districts ', '<div>Chhattisgarh will have 9 new districts with effect from January 2012, taking the total number of districts in the state to 27. These districts will be Sukma, Kondagaon, Gariabandh, Balodabazar, Balod, Bemetera, Mungeli, Surajpur and Balrampur.</div><div>&nbsp;</div><div>This was announced by the Chhattisgarh Chief Minister Raman Singh on 15 August 2011 while addressing the people on the occasion of the Independence Day at the police parade ground in Raipur. This step will be a mile stone in the administrative history of the state.</div>', '1450163717-cminitiativeb.jpg', 'Chattisgarh Districts', '1450163717-cminitiativem.jpg', 'Image', 1, '2015-12-15 07:15:17', '2011-08-15'),
(33, 23, 'ENG', 'Chhattisgarh Enforces Citizens\' Charter', 'In an important decision, the BJP government in Chhattisgarh today said it has enforced Citizens\' Charter in the state while bringing in 139 public services under it.', '1450163921-cminitiativeb.jpg', 'Citizen Character', '1450163921-cminitiativem.jpg', 'Image', 1, '2015-12-15 07:18:41', '2012-01-03'),
(34, 23, 'ENG', 'Krishak Jeevan Jyoti Scheme', 'In yet another significant move to strengthen the agriculture sector of the State, the State Cabinet on Tuesday approved the amended Krishak Jeevan Jyoti Yojana under which one member each of farmers\' family will be eligible to consume 6000 units of electricity on the use of electric motor pump up to 3 horse power and 7500 units of electricity will be free of cost for farmers using electric motor pump of capacity between 3 and 5 horse power for irrigation purpose in one fiscal. The farmer-friendly decision will result in an additional burden of Rs 255 crore per annum on the State Government. Farmers with 5 HP irrigation pumps are being provided with 6000 units of power without any charges, on an annual basis. Availability of adequate fertilizers and seeds has been ensured. From January 2008, Chhattisgarh become the countrys first state to enjoy load shedding-free power supply.', '1450164212-cminitiativeb.jpg', 'Jeevan Jyoti Scheme', '1450164212-cminitiativem.jpg', 'Image', 1, '2016-01-13 06:29:32', '2012-06-20'),
(35, 23, 'ENG', 'Atal Vihar Yojana', 'Chhattisgarh government will construct about 100,000 houses for poor and middle class people across the state under a scheme named after former Prime Minister Atal Bihari Vajpayee.The Atal Vihar Yojana would be launched in 40 towns in the state and would be completed in three years. The work on the ambitious housing project that had been designed with an estimated cost of Rs 11,800 crore would start later this month.', '1450165253-cminitiativeb.jpg', 'Atal Vihar Yojana', '1450165253-cminitiativem.jpg', 'Image', 1, '2016-01-13 06:28:59', '2011-07-07'),
(38, 0, 'ENG', NULL, NULL, '0', NULL, '0', '0', 0, '2016-03-11 13:47:40', '0000-00-00'),
(44, 26, 'ENG', 'My Vision', '<p class=\"MsoNormal\"><span style=\"background: white;\">Our Government took over the reins of power at a time when </span>the socio-economic condition of the State was at an all-time low. There was a complete breakdown of law and order and extremism was at its peak.</p><p class=\"MsoNormal\">We worked relentlessly for the upliftment of the society by focusing on industry, infrastructure, production, education, health, women, children, minorities and how to eradicate extremism, prejudices, and poverty from the State.</p><p class=\"MsoNormal\">In 2001, the power sector bore losses in distribution making it difficult for the Assam Electricity Board to cover its costs and supply adequate electricity. We promoted the idea of installation of digital meters in every household to overcome the loss and to benefit people in the long run.</p><p class=\"MsoNormal\">Similarly, infrastructure development was the next key area that we looked into to bridge the gap between rural and urban areas.</p><p class=\"MsoNormal\">The achievements of Assam are well documented and people have witnessed by themselves.</p><p class=\"MsoNormal\">In a quest to attain peace, prosperity and growth, we envisage Assam would be an example for the other states in India by 2030.</p><p class=\"MsoNormal\">We will ensure a society that is free from hunger and malnutrition.</p><p class=\"MsoNormal\">For sustainable development; agricultural growth, proper healthcare facilities, quality education, women empowerment and employment would continue to be on our priority list.</p>\r\n\r\n<p class=\"MsoNormal\">Looking at the trend of recovery in agriculture, we intend to accelerate more growth by finding the loopholes and filling those loopholes.</p>\r\n\r\n<p class=\"MsoNormal\">Assam Vision 2030 aims at reducing the child and maternal mortality rate to a minimum but it will also strive to bring down the rising epidemics in the state such as HIV, Cancer to a grinding halt resulting in an increase in &nbsp;life expectancy.&nbsp;</p>', '1458545271-cminitiativeb.jpg', 'My Vision', '1458545271-cminitiativem.jpg', 'Image', 1, '2018-03-24 15:24:01', '2016-03-01'),
(45, 29, 'ENG', 'My Vision', NULL, '1459342446-cminitiativeb.jpg', 'Dr. Salim Ali Bird Sanctuary', '1459342446-cminitiativem.jpg', 'Image', 1, '2017-05-05 15:24:21', '2015-10-09'),
