INSERT INTO `clientquotes` (`ClientQuoteID`, `CMSUserAuthenticationID`, `LanguageCode`, `ClientQuoteText`, `ClientQuoteCreatedDate`) VALUES
(1, 2, 'ENG', '<div>\"The least we can do is to respect the Constitution because that\'s the foundation on which our republic is built. If you give the Constitution the go-by, your republic will be under stress.\"</div><div><br></div><div><b>\"Rahul Gandhi\"</b></div>', '2015-05-15 14:00:14'),
(3, 2, 'ENG', 'There are people doing yoga in New York, dancing around; that\'s the power of India. You go to a nightclub somewhere in Spain and there\'s Amitabh Bachchan on the screen there, dancing around.', '2015-06-16 15:23:07'),
(5, 5, 'ENG', 'Todays age is the age of knowledge so I would like to say Acquire knowledge.', '2015-06-22 11:28:23'),
(7, 8, 'ENG', '\"Yoga Indias biggest gift to the world', '2015-06-29 13:19:26'),
(8, 13, 'ENG', 'Maintain balance between development and environment ', '2015-09-10 06:10:12'),
(9, 16, 'ENG', '\"Freedom has its life in the hearts, the actions, the spirit of men and so it must be daily earned and refreshed - else like a flower cut from its life-giving roots, it will wither and die.\"', '2015-09-14 07:02:30'),
(10, 18, 'ENG', 'In sports, I was representing my country, but in politics I represent people directly. I have always lived with a cause. In army, it was the existence of the sanctity of nation and the men I was commanding, and in sports, it was the pride of my country, while in politics, it is the rights of citizens I am fighting for.\"', '2015-09-23 13:13:33'),
(11, 23, 'ENG', 'Progressing Faster, Trusting Stronger our Chhattisgarh', '2015-12-15 07:42:00'),
(12, 26, 'ENG', 'Development of rural infrastructure, employment generation, promotion of small scale industries is the next thrust areas for the Government.', '2016-01-27 13:00:46'),
(13, 26, 'ENG', 'For the last fifteen years, I have taken up many developmental activities in Titabor. But I would say we have more to do in the field of education, employment, road and communication, agriculture. I want to complete the rest of the work and expedite development', '2016-03-18 13:12:09'),
(14, 26, 'ENG', 'Most of the people in Titabor are of the age of my son, cousin, daughter & grandson. I treat them as my own family', '2016-03-19 05:43:29'),
(15, 26, 'ENG', NULL, '2016-03-21 07:43:25'),
(17, 26, 'ENG', 'In our next term, we will stress more on job creation. No other state has matched number of jobs created in Assam. ', '2016-03-25 05:51:53'),
(18, 26, 'ENG', 'My birth and childhood in tea gardens and villages here have given me an understanding of the pain and problems of the rural areas.', '2016-03-27 06:33:31'),
(19, 26, 'ENG', 'We are for development of every community and religion and with the same objective of development we have formed development council.', '2016-03-29 07:49:13'),
(21, 29, 'ENG', NULL, '2016-03-30 11:52:55'),
(22, 26, 'ENG', 'It was me who took up the initiative for a connecting bridge from Nimatighat to Majuli. But the Satradhikars had told me that it would hamper the uniqueness of the island. So I gave a bridge in Dichangmukh.', '2016-03-31 06:20:39'),
(23, 26, 'ENG', 'Anyone in the tea gardens does not possess a house will be given Pukka houses.', '2016-03-31 07:48:23'),
(27, 30, 'ENG', 'Committed to the upliftment of the poor and tribal people!', '2016-05-07 05:27:55'),
(28, 31, 'ENG', 'Men are not the creature of circumstances,\r\nCircumstances are the creatures of men.', '2016-04-02 06:51:43'),
(29, 26, 'ENG', 'We have fought the language movement to safeguard the interest of both Assamese and Bengali community.', '2016-04-06 05:51:53'),
(30, 26, 'ENG', 'We want to be in power to help the poor, to help the youth and bring more development in the state.', '2016-04-07 10:21:18'),
(31, 26, 'ENG', 'People will not vote by watching TV but they will vote by watching our work.', '2016-04-08 16:21:36'),
(33, 26, 'ENG', 'May this Bohag Bihu brings peace and prosperity in the lives of the people of Assam. Happy Bohag Bihu! ', '2016-04-13 05:48:42'),
(34, 26, 'ENG', 'A positive thought in the morning can make your whole day positive.', '2016-04-19 11:00:54'),
(35, 26, 'ENG', 'I have directed the Chief Secretary and Supply department to form a task force to monitor and control inflation.', '2016-05-07 07:31:06'),
(36, 26, 'ENG', 'We have to stress upon education in such a way that it provides economic development later.', '2016-05-08 17:11:49'),
(37, 26, 'ENG', 'The true meaning of life is discovered when you forward your hand to those who need it .', '2016-05-09 12:36:03'),
(38, 26, 'ENG', 'I am sad that my party did not win maximum votes but certainly not disheartened. My supporters are always with me and that is why I won from Titabor constituency as they want to see me in power while I take a seat against the other opposition parties.', '2016-05-19 09:21:43'),
(40, 32, 'ENG', 'A creative man is motivated by the desire to achieve, not by the desire to beat others.', '2016-06-21 14:36:46'),
(41, 32, 'ENG', NULL, '2016-06-21 14:37:36'),
(42, 32, 'ENG', 'Good ideas are not adopted automatically. They must be driven into practice with courageous patience.', '2016-06-21 14:39:12'),
(43, 33, 'ENG', 'Work Is Worship', '2016-07-02 06:09:45'),
(44, 34, 'ENG', 'Fastest Growing, Digital Grampanchayat.', '2016-07-22 05:29:20'),
(45, 34, 'ENG', 'Progressive and Modern Grampanchayat always ready for the overall development of the village.', '2016-07-22 05:28:57'),
(47, 34, 'ENG', 'Always ready for the overall development.', '2016-07-21 07:28:39'),
(48, 35, 'ENG', 'Get up! Wake up! Change! Picture of your area!', '2016-11-21 12:29:54'),
(49, 50, 'ENG', 'Join Our Hands To Save The Nation!', '2019-07-13 05:59:06'),
(50, 51, 'ENG', 'Dont Let Yesterday Take Up Too Much Of Today.', '2020-01-23 12:51:23');
