INSERT INTO `clientschedules` (`clientScheduleID`, `ScheduleDate`, `ScheduleTitle`, `ScheduleDescription`, `CMSUserAuthenticationID`, `LanguageCode`) VALUES
(8, '2016-03-27 11:30', 'CM visiting Borholla today', 'Shri Tarun Gogoi will visit Borholla village of Jorhat district to meet people of village and will deliver a speech.', 26, 'ENG'),
(9, '2016-03-27 13:00', 'Shri Tarun Gogoi will visit Titatbor at later part of the day today', 'Shri Tarun Gogoi will visit Titabor at later part of the day after making his visit to Borholla today', 26, 'ENG'),
(10, '2016-03-28 15:00', 'Shri Tarun Gogoi visiting Bihali today', ' Shri Tarun Gogoi will be seen visiting Bihali of Sonitpur district. ', 26, 'ENG'),
(11, '2016-03-28 15:30', 'My visit to Rangapara ', 'After making my visit to Bihali, I will be visiting Rangapara of Sonitpur district to meet the people over there.', 26, 'ENG'),
(12, '2016-03-28 12:30', 'Shri Tarun Gogoi visiting Bokajan today', 'Mr. Gogoi will visit Bokajan of Karbi Anglong district today.', 26, 'ENG'),
(13, '2016-03-29 11:30', 'Shri Tarun Gogoi & Shri Rahul Gandhi will visit Diphu', 'Mr. Gogoi and Mr. Gandhi will make a visit to Diphu of East KarbiAnglong district tomorrow', 26, 'ENG'),
(14, '2016-03-29 16:00', 'CM and Mr. Rahul Gandhi at Nilam Bazar ', 'Nilam Bazar of Karimganj district would be crowded with supporters of Shri Tarun Gogoi and Shri Rahul Gandhi tomorrow.', 26, 'ENG'),
(15, '2016-03-29 14:00', 'Visiting Cachar on 29th March', 'After meeting the people of Diphu and Nilam Bazar, Hon\'ble Chief Minister Shri Tarun Gogoi and Congress VP, Shri Rahul Gandhi will end their day by meeting the people of Sonai of Cachar district to address their concern', 26, 'ENG'),
(16, '2016-03-30 11:30', 'Mr. Tarun Gogoi and Mrs. Sonia Gandhi at Amguri on 30th March', 'Shri Tarun Gogoi along with Smt. Sonia Gandhi will pay a visit to Amguri of Sibasagar District to interact with the people and address their problems.', 26, 'ENG'),
(17, '2016-03-30 13:00', 'Visiting Biswanath Chariali on 30th March', 'After paying a visit to Amguri, Mr. Gogoi and Mrs. Gandhi will be seen making their next stop at Biswanath Chariali of Sonitpur district', 26, 'ENG'),
(20, '2016-03-31 15:00', 'Shri Tarun Gogoi visiting Tezpur on 31st March at a later part of the day', 'Shri Tarun Gogoi and Shri Rahul Gandhi will end their day by meeting the people of Tezpur. The rally will be held at Tezpur Collegiate High School field.', 26, 'ENG'),
(21, '2016-04-01 10:30', 'Shri Tarun Gogoi visiting Majuli on 1st April', 'Shri Tarun Gogoi will meet the people of Majuli on 1st April', 26, 'ENG'),
(22, '2016-04-01 12:00', 'Shri Gogoi visiting Bokakhat on 1st April', 'After interacting with the people of Majuli, Shri Gogoi will be seen making his visit to Bokakhat at Rajabari. Join him at the rally and listen to his upcoming plans for the development of the state.', 26, 'ENG'),
(23, '2016-04-01 13:00', 'Visiting Sarupathar on 1st April', 'Shri Gogoi will land at Sarupathar of Golaghat district to address their problems and will be seen making promises to help them overcome their problems in his next term.', 26, 'ENG'),
(24, '2016-04-01 15:00', ' Dergaon Rally on 1st April has been called off', 'Due to time constraint, Shri Gogoi will not visit Dergaon today.', 26, 'ENG'),
(25, '2016-03-31 14:00', 'Shri Tarun Gogoi will visit Moran on 31st March', 'Mr. Gogoi and Mr. Gandhi will pay their next visit to Moran of Dibrugarh district. Show your support by joining them at the rally.', 26, 'ENG'),
(26, '2016-04-02 11:00', 'Shri Gogoi will meet the people of Khumati on 2nd April', 'At 11 AM, Shri Gogoi will arrive at Khumtai of Golaghat district to meet the locals and listen to their problems in order to resolve their problems in his next term as a Chief Minister of Assam. So, join him at the rally.', 26, 'ENG'),
(27, '2016-04-02 14:00', 'Shri Gogoi will arrive at Teok on 2nd April', 'After making his visit to Khumtai, Shri Gogoi will end the day by making his visit to Teok of Jorhat district. Be there to show your gratitude and support.', 26, 'ENG'),
(29, '2016-04-03 11:00', 'Shri Tarun Gogoi is coming to Dihing tomorrow', 'Shri Tarun Gogoi is coming to Dihing tomorrow', 26, 'ENG'),
(30, '2016-04-03 13:00', 'Meet Shri Tarun Gogoi at Bardowa tomorrow', 'Meet Shri Tarun Gogoi at Bardowa tomorrow', 26, 'ENG'),
(31, '2016-04-03 15:00', 'Shri Gogoi at Rupahihat and Kaliabor tomorrow', 'Shri Gogoi is coming to Rupahihat and Kaliabor of Nagaon district tomorrow to address a rally.', 26, 'ENG'),
(32, '2016-04-05 11:00', 'Shri Gogoi visiting Golakanj ', 'Shri Gogoi will visit Golakanj of Dhubri district at 11 AM today. Show your support by being present at the rally.', 26, 'ENG'),
(33, '2016-04-06 11:00', 'Meeting in Boko', 'Shri Tarun Gogoi will be present in Boko of Kamrup district to meet the people over there.', 26, 'ENG'),
(34, '2016-04-06 15:00', 'Shri Tarun Gogoi & Shri Manmohan Singh at Chandmari', 'After meeting the people of Boko, Shri Gogoi will come to Guwahati and address a rally at Chandmari. Shri Gogoi will be accompanied by Ex Prime Minister of India, Shri Manmohan Singh.', 26, 'ENG'),
(35, '2016-04-06 16:00', 'Meeting in Sualkuchi', 'Shri Gogoi will end the day after visiting Sualkuchi. Show your support to him by being present at the rally.', 26, 'ENG'),
(36, '2016-04-06 15:30', 'Shri Gogoi visiting Goroimari on 7th April', 'Shri Gogoi visiting Goroimari on 7th April', 26, 'ENG'),
(37, '2016-04-07 12:00', 'Shri Tarun Gogoi with Sonia Gandhi at Sarukhetri', 'Shri Tarun Gogoi with Smt.Sonia Gandhi at Sarukhetri of Barpeta district.', 26, 'ENG'),
(38, '2016-04-07 13:00', 'Shri Gogoi and Smt.Sonia Gandhi at Jagiroad', 'Shri Gogoi and Smt.Sonia Gandhi at Jagiroad', 26, 'ENG'),
(39, '2016-04-08 10:30', 'Shri Tarun Gogoi in Mankachar and Hatsingimari tomorrow', 'Shri Tarun Gogoi in Mankachar  and Hatsingimari of  South Salmara-Mankachar district tomorrow.', 26, 'ENG'),
(40, '2016-04-08 12:00', 'Shri Gogoi in West Bilasipara & Nayar Alga  tomorrow', 'Shri Gogoi will be  in Bilasipara & Nayar Alga of Dhubri district tomorrow.', 26, 'ENG'),
(41, '2016-04-08 14:00', 'Shri Gogoi in Mukalmua of Nalbari district', 'Shri Gogoi will be visiting Mukalmua of Nalbari district tomorrow.', 26, 'ENG'),
(42, '2016-04-08 15:30', 'Rangiya will welcome Shri Tarun Gogoi', 'Shri Gogoi will make a visit to Rangiya of Kamrup district tomorrow.', 26, 'ENG'),
(43, '2016-04-08 19:30', 'Shri Gogoi will address a rally at Fancy Bazaar', 'Shri Gogoi will address a rally at Fancy Bazaar in Guwahati', 26, 'ENG'),
(44, '2016-04-09 10:45', 'Shri Gogoi in Lumding tomorrow', 'Shri Gogoi in Lumding tomorrow.', 26, 'ENG'),
(45, '2016-04-11 10:00', 'Press Conference at Hotel Ambarish', 'Hon\'ble CM Shri Tarun Gogoi will attend a press conference at 10 AM.', 26, 'ENG'),
(46, '2016-04-11 13:00', 'CM visiting Maa Kamakhya Temple', 'Shri Tarun Gogoi will be receiving Mr. Manmohan Singh from LGBI airport  and will be seen visiting Maa Kamakhya temple', 26, 'ENG'),
(47, '2016-05-07 11:30', 'CM\'s Press Meet on 7th May, 2016', 'Chief Minister Tarun Gogoi will be attending a press conference at Hotel Ambarish, Ganeshguri', 26, 'ENG');
