INSERT INTO `cmsclientdetails` (`CMSClientDetailID`, `CMSUserPersonalDetailID`, `CMSUserAuthenticationID`, `LanguageCode`, `CMSClientUniquePhone`, `CMSClientURL`, `visionmission`, `CMSClientPersonalDescription`, `CMSClientPersonalImgPath`, `CMSClientPoliticalDescription`, `CMSClientPoliticalImgPath`, `CMSClientSocialDescription`, `CMSClientSocialImgPath`, `CMSClientProfilePicture`, `CMSClientWallpaper`, `CMSClientFBID`, `CMSClientTWID`, `CMSClientINSTID`, `CMSClientLINKID`, `CMSClientJobTitle`, `CMSClientThemeColor`, `CMSClientHomeBGPath`, `CMSClientInternalBGPath`, `CMSClientDescriptionBanner`) VALUES
(1, 1, 2, 'ENG', '07126629420', 'http://www.inc.in/', NULL, 'Rahul Gandhi About this sound pronunciation (born 19 June 1970) is the Vice-President of the Indian National Congress (INC) party and the Chairperson of the Indian Youth Congress and the National Students Union of India. Gandhi served as a general secretary in the All India Congress Committee and represents Amethi as its Member of Parliament (MP). He is the second-highest-ranked member of the Congress Working Committee.<div><br></div><div><div><b><font color=\"#00ced1\">Youth Congress and the National Students&nbsp;</font></b></div><div>Union of India.In 2008, senior Congress leader Veerappa Moily mentioned \"Rahul-as-PM\" idea when the PM of India Manmohan Singh was still abroad.</div></div>', '1432131632-pdimg.jpg', 'In March 2004, Rahul Gandhi announced his entry into politics by announcing that he would contest the May 2004 elections, standing for his father\'s former constituency of Amethi in Uttar Pradesh in the Lok Sabha, India\'s lower house of Parliament.The seat had been held by his mother until she transferred to the neighbouring seat of Rae Bareilly. The Congress had been doing poorly in Uttar Pradesh, holding only 10 of the 80 Lok Sabha seats in the state at the time.At the time, this move generated surprise among political commentators, who had regarded his sister Priyanka as being the more charismatic and likely to succeed. \r\n\r\nGandhi was appointed General Secretary of the All India Congress Committee on 24 September 2007 in a reshuffle of the party secretariat. In the same reshuffle, he was also given charge of the Indian.<div><br></div><div><b><font color=\"#00ced1\">Youth Congress and the National Students&nbsp;</font></b></div><div>Union of India.In 2008, senior Congress leader Veerappa Moily mentioned \"Rahul-as-PM\" idea when the PM of India Manmohan Singh was still abroad.</div>', '1432131632-poldimg.jpg', 'In September 2007 when he was appointed general secretary in charge of the Indian Youth Congress (IYC) and the National Students Union of India (NSUI), Gandhi promised to reform youth politics.[44] In his attempt to prove himself thus, in November 2008 Gandhi held interviews at his 12 Tughlak Lane residence in New Delhi to handpick at least 40 people who will make up the think-tank of the Indian Youth Congress (IYC), an organisation that he has been keen to transform since he was appointed general secretary in September 2007.<div><br></div><div><div><b><font color=\"#00ced1\">Youth Congress and the National Students&nbsp;</font></b></div><div>Union of India.In 2008, senior Congress leader Veerappa Moily mentioned \"Rahul-as-PM\" idea when the PM of India Manmohan Singh was still abroad.</div></div>', '1432131632-socdimg.jpg', '1431685845-pp.jpg', '1431685845-wp.jpg', 'https://www.facebook.com/India.RahulGandhi', 'https://twitter.com/bewithrg', 'https://instagram.com/rahulgandhi.inc/', 'https://www.linkedin.com/in/rahulgandhikabharat', 'Vice-President of the Indian National Congress ', '#07782f', NULL, NULL, NULL),
(4, 0, 5, 'ENG', '02222023059', 'http://www.bjp.org', NULL, '<div><div>MoS Maharashtra for industries and mining, environment, public works (excluding public undertakings) (BJP).&nbsp;</div><div>Guardian minister, Amravati district</div></div><div><br></div><div><br></div><div><br></div>', '0', '<br>', '0', 'State Minister, Industries and Mining, Environment, Public Works (excluding Public Undertakings).', '0', '1434973029-pp.jpg', '0', NULL, NULL, NULL, NULL, NULL, '#000000', NULL, NULL, NULL),
(5, 7, 8, 'ENG', '9226223355', 'http://www.rajnathsingh.in/', NULL, '<div>Rajnath Singh (born 10 July 1951) is an Indian politician belonging to the Bharatiya Janata Party (BJP) who currently serves as the Home Minister of India. He previously served as the Chief Minister of the state of Uttar Pradesh and as a Cabinet Minister in theVajpayee Government. He has also served as the President of the BJP twice, 20052009 and 20132014. He began his career as a physics lecturer and used his long-term connections with the nationalist organisation, Rashtriya Swayamsevak Sangh to become involved with the Janata Party.</div><div><br></div><div>Singh was born in the small village of Bhabhaura in Chandauli district of the Indian state of Uttar Pradesh in a Rajput family. His father was Ram Badan Singh and his mother was Gujarati Devi. He was born into a family of farmers and went on to secure a masters degree in physics, acquiring first division results from the Gorakhpur University. Rajnath Singh had been associated with the Rashtriya Swayamsevak Sangh since 1964, at the age of 13 and remained connected with the organisation even during his employment as a physics lecturer in Mirzapur. In 1974, he was appointed secretary for the Mirzapur unit of the Bharatiya Jan Sangh, predecessor of Bhartiya Janta Party.</div>', '1435840662-pdimg.jpeg', 'In 1975, aged 24, Singh was appointed District President of the Jana Sangh. In 1977, he was elected Member of Legislative Assembly from the Mirzapur constituency. He became the State President of the BJP youth wing in 1984, the National general secretary in 1986 and the National President in 1988. He was also elected into the Uttar Pradesh legislative council. \r\nIn 1991, he became Education Minister in the first BJP government in the state of Uttar Pradesh. Major highlights of his tenure as Education Minister included Anti-Copying Act, 1992, which made copying a non-bailable offence, rewriting history texts and incorporating vedic mathematics into the syllabus. In April 1994, he was elected into the Rajya Sabha (Upper House of the Indian Parliament) and he became involved with the Advisory committee on Industry (199496), Consultative Committee for the Ministry of Agriculture, Business Advisory Committee, House Committee and the Committee on Human Resource Development. On 25 March 1997, he became the President of the BJP\'s unit in Uttar Pradesh and in 1999 he became the Union Cabinet Minister for Surface Transport. \r\n\r\nIn 2000, he became Chief Minister of Uttar Pradesh and was twice elected as MLA from Haidergarh in 2001 and 2002. He tried to rationalise the reservation structure in government jobs by introducing the most Backward Classes among the OBC and SC, so that the benefit of reservation can reach the lowest status of Society. \r\n', '1435840662-poldimg.jpeg', 'In 2003, Singh was appointed as the Minister of Agriculture and subsequently for Food Processing in the NDA Government led byAtal Bihari Vajpayee, and was faced with the difficult task of maintaining one of the most volatile areas of India\'s economy. During this period he initiated a few epoch-making projects including the Kisan Call Centre and Farm Income Insurance Scheme. He brought down interest rates on Agriculture loans and also established Farmer Commission and initiated Farms Income Insurance Scheme. \r\nAfter the BJP lost power in the 2004 general elections, it was forced to sit in the Opposition. After the resignation of prominent figureLal Krishna Advani, and the murder of strategist Pramod Mahajan, Singh sought to rebuild the party by focusing on the most basicHindutva ideologies. He announced his position of \"no compromise\" in relation to the building of a Ram Temple in Ayodhya at any cost and commended the rule of Vajpayee as Prime Minister, pointing towards all the developments the National Democratic Alliance made for the ordinary people of India. He also criticised the role of the English language in India, claiming that it caused erosion of cultural values. \r\n\r\nOn 24 January 2013, following the resignation of Nitin Gadkari due to corruption charges, Singh was re-elected as the BJP\'s National President. \r\nHe contested the 2014 Lok Sabha elections from Lucknow constituency and was subsequently elected as a Member of the Indian Parliament. \r\nHe was appointed the Union Minister of Home Affairs in the Narendra Modi government and was sworn in on 26 May 2014.', '1435840662-socdimg.jpeg', '1435584230-pp.jpeg', '1435581944-wp.jpeg', 'RajnathSinghBJP', '<a class=\"twitter-timeline\" href=\"https://twitter.com/BJPRajnathSingh\" data-widget-id=\"616187569118687232\" width=\"310\"  height=\"450\">Tweets by @BJPRajnathSingh</a>\r\n<script>!function(d,s,id){var js,fjs=d.getElementsByTagName(s)[0],p=/^http:/.test(d.location)?\'http\':\'https\';if(!d.getElementById(id)){js=d.createElement(s);js.id=id;js.src=p+\"://platform.twitter.com/widgets.js\";fjs.parentNode.insertBefore(js,fjs);}}(document,\"script\",\"twitter-wjs\");</script>', NULL, NULL, NULL, '#07782f', NULL, NULL, NULL),
(6, 12, 13, 'ENG', '02261074681', 'http://www.nitingadkari.org/', NULL, '<p class=\"MsoNormal\">Nitin Jairam Gadkari, born 27 May 1957, is an Indian politician and the current Transport minister under the BJP central cabinet in the 16th Loksabha. Mr Gadkari was appointed to head BJP in December 2009 after the party suffered a defeat in the general elections earlier that year. He is also known for the works during his tenure as a Public Works Department Minister in the state of Maharashta when he constructed a series of roads, highways and flyovers across the state including the Yashwantrao Chavan MumbaiPune Expressway.Nitin Gadkari was born in Nagpur, India. During his teens, he worked for the Bharatiya Janata Yuva Morcha and the student union Akhil Bharatiya Vidyarthi Parishad (ABVP).Gadkari is married to Kanchan Gadkari and they have three children. He currently lives in Nagpur close to the head office of Rashtriya Swayamsevak Sangh.</p>', '1441970873-pdimg.jpg', '<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt;\">Nitin Gadkari served as the Minister of Public Works Department (PWD)\r\nof the Government of Maharashtra from 1995 to 1999 and restructured it from top\r\nto bottom. He has served as the president of the Maharashtra BJP. Nitin Gadkari\r\nwas seeking second term as Bhartiya Janta Party President but resigned from the\r\npost on 22 January 2013, due to irregularities in the firm Purti Group promoted\r\nby him.Many senior party leaders, such as Yashwant Sinha, were against the\r\nre-election of Nitin Gadkari.Gadkari contested 2014 Loksabha election successfully from Nagpur\r\nconstituency and won.He defeated Congress leader Vilas Muttemwar by margin of\r\n285,000.</p>', '1441970873-poldimg.jpg', '<div>Mr. Gadkari completed several prestigious assignments in record time. His two achievements stand out in particular. He pioneered the concept of Public-Private partnership (PPP) in infrastructure development. The BOT (Build-Operate-Transfer) model has the basis of this concept. It is now implemented widely in India, thanks to this initiative large budgetary funds were made available for rural road development. The other is the up-gradation of norms for the construction industry. Completion of mega projects in a time bound frame, too, is his initiative. Establishment of a Maharashtra State Road Development Corporation (MSRDC) was one of his innovative initiatives through which funds were raised from open market for infrastructure projects for the first time in India.</div><div>Mr. Gadkari is also an agriculturist. He has promoted Water Management, Solar Energy Projects and the use of modern technology &amp; management tools in agriculture. He has a passion for bio-fuel and non-conventional sources of energy. His patronage to the social entrepreneurship has brought enormous development in the catchment areas of Nagpur region, notorious for farmers\" suicide.</div><div>Mr. Gadkari has also carried out many social welfare projects in Vidarbha region including making several villages self-sufficient by solar energy, couple of thousand heart surgeries and solar rickshaws for the needy.</div><div><br></div>', '1441970873-socdimg.jpg', '1441791361-pp.jpg', '0', 'nitingadkary', '<a class=\"twitter-timeline\" href=\"https://twitter.com/nitin_gadkari\" data-widget-id=\"641612381336932352\" width=\"310\"  height=\"450\">Tweets by @nitin_gadkari</a>\r\n<script>!function(d,s,id){var js,fjs=d.getElementsByTagName(s)[0],p=/^http:/.test(d.location)?\'http\':\'https\';if(!d.getElementById(id)){js=d.createElement(s);js.id=id;js.src=p+\"://platform.twitter.com/widgets.js\";fjs.parentNode.insertBefore(js,fjs);}}(document,\"script\",\"twitter-wjs\");</script>', NULL, NULL, NULL, '#07782f', NULL, NULL, NULL),
(7, 15, 16, 'ENG', '9423684600', 'http://www.brijmohanagrawal.in', NULL, '<p class=\"MsoNormal\">Brijmohan Agrawal born on 1<sup>st</sup> &nbsp;May 1959 which merrily coincides with the\r\nLabour Day he is a cabinet minister in the Bharatiya Janata Party ministry of\r\nChhattisgarh state of India. He is the education minister of Chhattisgarh.\r\nUntil 2013 he was minister of Public Works Department, School Education,\r\nEndowment, Culture, Legislative Affairs and Tourism Departments. Since\r\nthe 2013 reshuffle he has been Minister of Agriculture, Animal Husbandry, Fish\r\nRearing and Water Resources.</p>\r\n\r\n<p class=\"MsoNormal\">Brijmohan Agarwalji\'s life has always been an inspirational\r\nsource for all of us. He has achieved the success by his dedication,\r\ndetermination and the commitment towards his work. The established business\r\nhouse of Raipur city has given all the facilities for the growth and the\r\ndevelopment of his political life. He have always followed the path of truth\r\nand sacrifice. He always fought for the cause of poor, downtrodden, women,\r\nchildren and abandoned people. For the economic and the overall development of\r\nthe state,he fought to decrease the gap between the upper and lower class of\r\nsociety. From his student life he worked for this vision. When he met with Shri\r\nAtal Bihari Vajpayee, he got a good support from him. Soon Shri Vajpayee became\r\nhis role model. He have served his whole service for the upliftment of the\r\nstate.</p>', '1443010268-pdimg.jpg', '<p class=\"MsoNormal\">1977: Brijmohan Agarwal joined Bhartiya Janta Party. He\r\nbecame actively involved in students politics. </p>\r\n\r\n<p class=\"MsoNormal\">1981-82:&nbsp; He became President of Durga Mahavidyalaya\r\nRaipur. In the same year he also became Chief Advisor of university student\r\nunion of Pt. Ravishankar Shukla University Raipur.</p>\r\n\r\n<p class=\"MsoNormal\">1982-83:&nbsp; He was chosen to the past of President\r\nstudent union of kalian Mahavidyalaya, Bhilai. In the same year he became\r\nchairman of Agarwal youth boards a post on which he worked for eight years. He\r\nled the youth to do social work.</p>\r\n\r\n<p class=\"MsoNormal\">1984: &nbsp;Brijmohan\r\nAgarwal became active member of Bhartiya Janta Party.</p>\r\n\r\n<p class=\"MsoNormal\">1986:&nbsp; Witnessing his\r\nleadership and organizational acumen the party appointed him as youth minister\r\nof Bhartiya Janta Yuva Morcha .</p>\r\n\r\n<p class=\"MsoNormal\">1988-90:&nbsp; Looking at\r\nhis contribution the party made him Vice-President of Bhatiya Janta Yuva\r\nMorcha.</p>\r\n\r\n<p class=\"MsoNormal\">1988-92:&nbsp; While\r\nworking as vice president A Bhartiya Janta Yuva Morcha, he became member of and\r\nlater on he worked as in the Capacity Of Director.</p>\r\n\r\n<p class=\"MsoNormal\">1989:&nbsp; He was elected\r\nUniversity Representative, Pt. Ravishankar Shukla University.</p>\r\n\r\n<p class=\"MsoNormal\">1990:&nbsp; Breaking the\r\nstronghold of congress party Brijmohan Agarwal was elected as M.L.A of Bhartiya\r\nJanta Party from Raipur city. Since then his hard work, congenial native and\r\ninvolvement has made him win 1993,98,2003 and 2008Vidhan sabha elections. The\r\nmargin of victory keeps increasing in each election.</p>\r\n\r\n<p class=\"MsoNormal\">1990: &nbsp;He was the\r\nyoungest M.L.A who was chosen to Legislative Assembly of undivided Madhya\r\nPradesh. The party and the then Chief Minister Sunder Lal Patwa included him in\r\nministry as minister local government (Independent Charge), science and\r\nTechnology and tourism.</p>\r\n\r\n<p class=\"MsoNormal\">1991-94: He became secretary of Bhartiya Janta Yuva Morcha\r\n.In the same year Rotary International conferred on him honorary membership.</p>\r\n\r\n<p class=\"MsoNormal\">1993:&nbsp; He was\r\nappointed General Secretary of Bhartia Janta Yuva Morcha . In the same was\r\nelected as a M.L.A. He was also nominated as member of Privileges committee.</p>\r\n\r\n<p class=\"MsoNormal\">1998: &nbsp;Brijmohan\r\nAgarwal at the position of chief whip of BJP Legislative Party worked as a\r\nminister of BJP state working committee public undertaking committee. He also\r\nheld the important position of member National Executive of Bhartia Janta Yuva\r\nMorcha.</p>\r\n\r\n<p class=\"MsoNormal\">2000: He was elected as a M.L.A from Raipur and worked as a\r\nmember of public accounts committee and member of Business Advisory committee\r\nof Chhattisgarh Vidhan Sabha.</p>\r\n\r\n<p class=\"MsoNormal\">2003:&nbsp; He became M.L.A\r\nfrom Raipur city and includes in the cabinet as minister Home, Prison, Culture\r\nand Tourism.</p>\r\n\r\n<p class=\"MsoNormal\">2005:&nbsp; He became\r\nMinister-Revenue, culture and tourism, Law, Rehabilitation.</p>\r\n\r\n<p class=\"MsoNormal\">2006:&nbsp; Additional\r\ncharge of forest, sports and youth Affairs was given to him.</p>\r\n\r\n<p class=\"MsoNormal\">2008:&nbsp; He became\r\nminister of School Education, Public Works Department, Parliamentary Affairs,\r\nTourism and Endowment Trust Culture under the Government of Chhattisgarh.</p>\r\n\r\n<p class=\"MsoNormal\">2013: He became minister of of Agriculture, Animal\r\nHusbandry, Fish Rearing, Water Resources under the Government of Chhattisgarh.</p>', '1443009961-poldimg.jpg', '<p class=\"MsoNormal\">Agarwal joined Akhil Bharatiya Vidyarthi Parishad (ABVP) in\r\n1977 that saw his entry in student politics. Thereafter, he became actively\r\ninvolved and held key positions in students politics. He became President of\r\nthe Agarwal Yuva Mandal in 1980 and continued till 1985. From 1981 to 1982, he\r\nwas President of his college, Durga Mahavidyalaya in Raipur, and also was Chief\r\nAdvisor of the University Student Union of Pt. Ravishankar Shukla University,\r\nRaipur. From 1982 to 1983, he was the President of Kalyan College Student Union\r\nin Bhilai. Later in 1984, he became an active member of Bharatiya Janata Party.</p>', '1442228015-socdimg.JPG', '1442999690-pp.jpg', '0', 'brijmohanagrawal.official', '<a class=\"twitter-timeline\" href=\"https://twitter.com/brijmohan_cg\" data-widget-id=\"646616071131140096\" width=\"310\"  height=\"450\">Tweets by @brijmohan_cg</a>\r\n<script>!function(d,s,id){var js,fjs=d.getElementsByTagName(s)[0],p=/^http:/.test(d.location)?\'http\':\'https\';if(!d.getElementById(id)){js=d.createElement(s);js.id=id;js.src=p+\"://platform.twitter.com/widgets.js\";fjs.parentNode.insertBefore(js,fjs);}}(document,\"script\",\"twitter-wjs\");</script>', NULL, NULL, NULL, '#07782f', NULL, NULL, NULL),
