(17, 34, 34, 'ENG', '9762411111', 'http://voterfirst.in', '<div>Till date development works such as Concrete Roads,Plenty Drinking Water,Wi-Fi &amp; CCTV camera in village, Clean and garbage free village,Street Lights,Drainage Line,Fully Air Condition Z.P.Schools,Womens security, Youth Employment, Small Garden and benches for elders peoples and children and many things have been completed in &nbsp;Narhegaon.Rather than politics Sarpanch mostly concentrate on Social Development and Public Welfare.</div>', 'Name: Bhushan Rohidas Ranawade (Patil)<br>DOB: 08/05/1988<br>Childhood: Narhegaon<br><br>He had two Younger Sisters &amp; mother in his family. From childhood onwards he was doing farming before getting elected and his whole family was dependent on him.<br><br>Personal Achievement: He made a record at the age of 24 as he was elected as Sarpanch of the Narhegaon Grampanchayat. In his life he faced struggles as he was the earning person in his family. Even though he worked as a farmer, he also completed his education side by side. Village was poor and had no funds until he become Sarpanch. Later when he got elected as Sarpanch, he made an efforts and make his Grampanchayat as Adarsh-Grampanchayat which made a turnover of Grampanchayat till date. He made a clean, green &amp; a digital village having more than 1,00,000 people.', '1467463173-pdimg.JPG', 'He made an Adarsh - Grampanchayat &amp; made a turnover of Grampanchayat up to . till today. He made a clean, green &amp; a digital village having more than 1.00.000 people. Development of Narhegaon is the main vision of The Sarpanch.So he made 80% concrete roads,Digital Village and also making efforts for green,healthy and clean Narhegaon.&nbsp;', '1469015847-poldimg.jpg', '<b>The social problems of the citizens has been a priority of The Sarpanch.After Becoming Sarpanch he made various social activities in the Narhegaon.</b><div><br></div><div><b>1)Concrete Roads:-</b> Upto <b>80%</b> roads are now Concrete Roads.Sarpanch decided to make his village roads fully concrete road and remaining 20% roads are proposed to become concrete road.</div><div><br></div><div><b>2)Drinking Water:-</b> Drinking water is basic need of Human.So Sarpanch made a good management to avail sufficient drinking water in each house.Now about 38 lakhs drinking water line from Vadgaon Canal to Narhegaon is in Progress.Upto 50% work of it is done.</div><div><br></div><div><b>3)Wi-fi And CCTV Cameras:-</b> Now technology is developing very fastly.So Sarpanch also decided make his village digital.So he started <b>open and free wifi </b>facility for every person.Also to avoid crimes and increasing safety of womens Sarpanch decided to fix <b>CCTV cameras</b> in each corner of Narhegaon.Total <b>52 Cameras</b> are <b>24 x 7</b> keeping watch on each and every movement.</div><div><br></div><div><b>4)Clean and Garbage Free Narhegaon</b>:- For keeping narhegaon clean and garbage free sarpanch makes social awareness programmes and rallies.And main thing to avoid garbage they provided garbage collecting cars.Also his creative mind develop an idea to keep watchman\'s to avoid garbage.This watchman helps to avoid garbage in open place also helps in increasing Security of Narhegaon. There are <b>17&nbsp;watchman\'s</b>&nbsp;are keeping <b>24 X 7</b> watch to avoid Garbage.</div><div>&nbsp;</div><div><b>5)Underground Drainage :-</b>Main Development of any village is depend on its drainage facility.So this point continuously flashes in a mind of Sarpanch Bhushan Ranawade Patil.So he Concentrated on drainage system of Narhe Gaon.Sarpanch first make proper plan of drainage system with the help of workers and peoples of Narhe Gaon.And after making plan Sarpanch struggles and make a large fund availability of funds for drainage line.after sanctioning fund drainage work started very fast and now Narhegaon\'s drainage system is an inspirational system for other village.About <b>75% drainage lines are underground.</b></div><div><div><br><br></div></div>', '1469015847-socdimg.jpg', '1467463173-pp.jpg', '0', 'BhushanRanwade', NULL, NULL, NULL, NULL, '#54ab73', NULL, NULL, NULL),
(19, 0, 35, 'ENG', '09893309757', 'https://www.facebook.com/girish.sharma.581730?fref=ts', '<span style=\"font-size:11.0pt;font-family:&quot;Calibri&quot;,&quot;sans-serif&quot;;\r\nmso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\">In the region of Bhopal Girls College and Govt.\r\nHospital- Bhopal people should get all basic Facilities. I will give Better\r\neducation, health and more employment. I will make sure that the children of\r\npoor and middle class will get good education.</span>', '<div>Date of Birth:- 10/07/1976</div><div>Birth location:- Bhopal</div><div>Childhood:- Bhopal&nbsp;</div><div>Education:- Bhopal</div><div>Family Members name:-</div><div>1. Kshama Sharma (Mother)</div><div>2. Late Manju Sharma (Wife)</div><div>3. Simmi Sharma (Child)</div><div>4. Rahul Sharma (Child)</div><div>5. Sunil Sharma (Brother)</div>', '1481279210-pdimg.JPG', 'Start in politics as a student leader in Bhopal, the social service work through NGOs in the political area. &nbsp;After winning election in Ward No. 67, won the election again from Ward No. 67. Given the public sector and devotion to duty as a Councillor again made victorious.', '1481103363-poldimg.png', 'At the first time Smart Classes were launched in public school of Narela Shankari. Always ready to diagnose the problems from road construction sector to small to large parks and fields. People blessed and won best votes.', '1481103062-socdimg.png', '1481279210-pp.JPG', '0', 'https://www.facebook.com/girish.sharma.902', 'girishsharma', NULL, NULL, NULL, '#54ab73', NULL, NULL, NULL),
