ince the 1500s is reproduced below for those interested. Sections 1.10.32 and 1.10.33 from \"de Finibus Bonorum et Malorum\" by Cicero are also reproduced in their exact original form, accompanied by English versions from the 1914 translation by H. Rackham.</span>', '1561457700-socdimg.jpg', '1561457700-pp.jpg', '1561457700-wp.jpg', 'FacebookPage', 'http://www.twitter.com', 'instagramID', 'LinkedInID', 'MLA', '#00ff00', '1561457700-hbg.jpg', '1561457700-ibg.jpg', '1561457700-dbg.jpg'),
(22, 0, 51, 'ENG', '08888817777', 'https://en.wikipedia.org/wiki/Sunil_Baburao_Mendhe', NULL, '<b>Sunil Baburao Mendhe</b> is an Indian politician and a <a href=\"https://en.wikipedia.org/wiki/Member_of_parliament\" title=\"Member of parliament\">member of parliament</a> to the <a href=\"https://en.wikipedia.org/wiki/17th_Lok_Sabha\" title=\"17th Lok Sabha\">17th Lok Sabha</a> from <a href=\"https://en.wikipedia.org/wiki/Bhandara%E2%80%93Gondiya_(Lok_Sabha_constituency)\" title=\"BhandaraGondiya (Lok Sabha constituency)\">BhandaraGondiya Lok Sabha constituency</a>, <a href=\"https://en.wikipedia.org/wiki/Maharashtra\" title=\"Maharashtra\">Maharashtra</a>. He won the <a href=\"https://en.wikipedia.org/wiki/2019_Indian_general_election\" title=\"2019 Indian general election\">2019 Indian general election</a> being a <a href=\"https://en.wikipedia.org/wiki/Bharatiya_Janata_Party\" title=\"\">Bharatiya Janata Party</a> candidate.<sup id=\"cite_ref-1\" class=\"reference\"><a href=\"https://en.wikipedia.org/wiki/Sunil_Baburao_Mendhe#cite_note-1\">[1]</a></sup>\r\n These Bhandara-Gondia Constituency is considered as Toughest seat To \r\nWin For BJP , However Mendhe easily Defeated The Heavyweight Minister \r\npanchpudhe by 2 Lakhs Votes . These Seat was A huge shock For NCP . \r\nBecause These Region was considered as Praful Patel\'s Bastion Earlier.\r\n', '1577111366-pdimg.jpg', '<table id=\"ContentPlaceHolder1_Datagrid3\" cellspacing=\"0\"><tbody><tr><td><table><tbody><tr><td class=\"griditem2\" width=\"185px\">2016\r\n                                    </td>\r\n                                    <td class=\"griditem2\">\r\n                                        President, Bhandara Municipal Corporation\r\n                                    </td>\r\n                                </tr>\r\n                            </tbody></table>\r\n                        </td>\r\n	</tr><tr>\r\n		<td>\r\n                            <table>\r\n                                <tbody><tr>\r\n                                    <td class=\"griditem2\" width=\"185px\">\r\n                                        May, 2019\r\n                                    </td>\r\n                                    <td class=\"griditem2\">\r\n                                        Elected to 17<sup>th</sup> Lok Sabha\r\n                                    </td>\r\n                                </tr>\r\n                            </tbody></table>\r\n                        </td>\r\n	</tr><tr>\r\n		<td>\r\n                            <table>\r\n                                <tbody><tr>\r\n                                    <td class=\"griditem2\" width=\"185px\">\r\n                                        13 Sept. 2019 onwards\r\n                                    </td>\r\n                                    <td class=\"griditem2\">\r\n                                        Member, Standing Committee on Transport, Tourism and Culture\r\n                                    </td></tr></tbody></table></td></tr></tbody></table>', '1577111366-poldimg.jpg', '<table width=\"550px\"><tbody><tr><td class=\"darkerb\" valign=\"top\" align=\"left\">Social And Cultural Activities\r\n                                    </td>\r\n                                </tr>\r\n                                <tr>\r\n                                    <td class=\"griditem2\" valign=\"top\" align=\"left\">\r\n                                        Former President, Lion Club, Bhandara; Cabinet Officer, Lion Club, Bhandara\r\n                                    </td>\r\n                                </tr>\r\n                                <tr>\r\n                                    <td>\r\n                                        &nbsp;\r\n                                    </td>\r\n                                </tr>\r\n                                <tr>\r\n                                    <td class=\"darkerb\" valign=\"top\" align=\"left\">\r\n                