(5, 5, 'ENG', ' Development of Amravati MIDC top priority, says Pote', 'Amravati', 'Maharashtra', 'Amravati', '444602', 'From Member of Legislative Council (MLC) in 2012 to minister of state for industries, mining and environment in the Devendra Fadnavis government, it has been a meteoric rise in politics for Pravin Pote. The clean image of this leader from western Vidarbha is one of the factors behind his selection for the ministerial berth. Despite being part of the \'core circle\' of the CM, Pote says he is still a grassroots worker. \"I want to remain a party worker and not a minister who sits in a closed-door cabin,\" he says. Development of Amravati MIDC, Belora airport and railway wagon repairs factory in Badnera are his top priorities, besides making the city slum-free.', NULL, 0, 0, '2012-07-19 15:29:00', '2012-11-29 15:29:00', '1434978754-em.jpg', 'Image', 0, 0, 0, 0, 1, '0000-00-00 00:00:00'),
(6, 5, 'ENG', 'Fadnavis inaugurates textile park in Amravati', 'Amravati', 'Maharashtra', 'Amravati', '444602', 'Maharashtra CM Devendra fadnavis laid foundation stone for starting additional facilities for Textile Park in Nandgaon Peth MIDC, Amravati.\r\nHe also laid foundation stone for Siyaram Silk Mills. Siyaram is investing Rs 250 crore with an employment generation of 250. Industries Minister Shri Subhash Desai, Minister Shri Praveen Pote, Minister Ranjit Patil, MP Anand Adsul, MLA Sunil Deshmukh, Dr. Anil Bonde, MLA Yashomati Thakur too were present.', NULL, 0, 0, '2015-06-17 18:42:00', '2015-07-01 18:42:00', '1434978082-em.jpg', 'Image', 0, 0, 0, 0, 1, '0000-00-00 00:00:00'),
(7, 2, 'ENG', 'Congress puts off mega event on Ambedkar Jayanti', 'New Delhi', 'Delhi', 'Delhi', '110006', 'With Rahul Gandhi yet to return from his sabbatical, Congress has decided to hold a low-key function on Tuesday to mark the beginning of the year-long celebrations of B R Ambedkars 125th birth anniversary. While, senior leader Sushil Kumar Shinde would attend a function in Mhow, the birth place of Ambedkar, on Tuesday, the party would now kick-off the nationwide celebrations at an event in the Madhya Pradesh town next month, which will be attended by Rahul. Congress wanted to launch the celebrations in a big way, but Rahuls unavailability forced it to redraw the schedule.', NULL, 0, 0, '2015-06-03 19:45:00', '2015-06-26 19:45:00', '1434981897-em.jpg', 'Image', 0, 0, 0, 0, 1, '0000-00-00 00:00:00'),
(8, 2, 'ENG', 'Freedom Movement', 'New Delhi', 'Delhi', 'Delhi', '110011', 'The Indian freedom movement was perhaps the greatest mass movement in world history. After 1919, it was built around the notion that people had to and could play an active role in politics and in their own liberation.', NULL, 0, 0, '2015-06-16 19:48:00', '2015-07-02 19:48:00', '1434982022-em.jpg', 'Image', 0, 0, 0, 0, 1, '0000-00-00 00:00:00'),
(9, 8, 'ENG', 'Union minister for home affairs Rajnath Singh on Friday asked the Punjab government ', 'Abdal', 'Punjab', 'Amritsar', '143502', 'Union minister for home affairs Rajnath Singh on Friday asked the Punjab government to make fight against drugs a peoples movement. He was addressing a congregation here to mark the 350th year of setting up of Anandpur Sahib by ninth Guru Tegh Bahadur.', NULL, 31.7426, 75.0794, '2015-06-16 13:42:00', '2015-07-02 13:42:00', '1435132920-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-07-03 14:41:31'),
(10, 8, 'ENG', 'Home minister Rajnath Singh chose to speak much beyond his ministry\'s remit  on economy', 'Ayodhya ', 'Uttar Pradesh', 'Ayodhya ', '226021', 'Declaring himself to be a man for all seasons, home minister Rajnath Singh chose to speak much beyond his ministry\'s remit  on economy, diplomacy and the Ram temple  on Friday, signifying his official number 2 status in the Modi government.  Rajnath Singh today acknowledged that building of Ram temple in Ayodhya is an important issue and the Government would welcome an out of court settlement.', NULL, 26.7976, 82.2055, '2015-06-18 13:45:00', '2015-07-02 13:45:00', '1435133073-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-07-03 14:41:08'),
(11, 8, 'ENG', 'Union Home Minister Rajnath Singh on Friday praised the Khalsa Panth, the Sikh community', 'Chheherta ', 'Punjab', 'Amritsar', '143105', 'Anandpur Sahib: Union Home Minister Rajnath Singh on Friday praised the Khalsa Panth, the Sikh community, for promoting secularism and the cultural heritage of the country. Addressing a gathering at the conclusion of the three-day celebrations of the 350th anniversary of the foundation of this historic Punjab town, he said the Sikhs and the Khalsa Panth played a great role not only in defending India but also promoting secularism and cultural heritage.', NULL, 31.6222, 74.7945, '2015-06-10 13:53:00', '2015-07-02 13:53:00', '1435133555-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-07-03 14:41:26'),
(12, 8, 'ENG', 'Economic policies adopted by Narendra Modi government will be reflected on the ground', 'Raipur', 'Chhattisgarh', 'Raipur', '493332', 'RAIPUR:  The results of economic policies adopted by Narendra Modi government will be reflected on the ground in three years and the country will get \"complete economic freedom\" in five to seven years, Home Minister Rajnath Singh said today.\r\nAddressing a function after inaugurating the headquarters of the Chhattisgarh Police, Mr Singh said India had attained the political freedom years ago but the economic freedom is yet to be achieved.', NULL, 0, 0, '2015-06-09 13:55:00', '2015-07-02 13:55:00', '1555315326-em.png', 'Image', 0, 0, 0, 0, 1, '2019-05-28 08:45:06'),
(13, 8, 'ENG', 'Rajnath visited Sukma and inaugurated the first fortified police station ', 'Sukma', 'Chhattisgarh', 'Sukma ', '494111', 'Home Minister Rajnath Singh on Sunday urged Maoists to drop their weapons and come back to the mainstream. - Rajnath visited Sukma and inaugurated the first fortified police station of the state in Dornapal. It is among 75 such stations being constructed in the state from the central funds. He also flew to the Chintagufa police camp, located near Tadmetla, where Maoists had killed 76 personnel in 2010.', NULL, 18.3911, 81.6593, '2015-06-02 14:00:00', '2015-06-25 14:00:00', '1435133971-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-08-05 13:39:40'),
(14, 8, 'ENG', 'Rajnath Singh on Sunday stated that New Delhi has appealed to Pakistan to help in tackling terrorism', 'Near Airport', 'Delhi', 'New Delhi', '110001', 'Union Home Minister Rajnath Singh on Sunday stated that New Delhi has appealed to Pakistan to help in tackling terrorism.\r\n\r\nWe have appealed to Pakistan to help in tackling terrorism because Pakistan today is facing crisis due to terrorism. Our government is taking all possible measures to tackle terrorism. Not just India, but entire world knows who is responsible for terrorism, Singh told the media here.', NULL, 28.6314, 77.2233, '2015-06-10 14:05:00', '2015-07-02 14:05:00', '1435134260-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-08-05 13:39:05'),
(15, 13, 'ENG', 'Inaugurated the annual nehru trophy boat', 'Poonch', 'Kerala', 'Poonch', '185101', 'Shri. Nitin Gadkari inaugurated the annual nehru trophy boat racr, also popularly known as the snake boat race, at punnamada lake in alappuzha district in the state of kerla on august 8 2015.', NULL, 33.7717, 74.0946, '2015-09-08 18:33:00', '2015-10-03 18:33:00', '1441803998-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-09-11 11:28:19'),
(16, 13, 'ENG', 'Foundation stone laying ceremony', 'SIRSA, HARYANA', 'Haryana', 'SIRSA', '125055', 'Shri Nitin Gadkari addressing at the foundation stone laying ceremony for the four-laning of hisar-dabwali national highway, at sirsa, haryana on july 20, 2015.', NULL, 29.5336, 75.0177, '2015-09-09 18:40:00', '2015-10-31 18:40:00', '1441804262-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-09-11 11:29:04'),
(17, 13, 'ENG', 'SHRI NITIN GADKARI INAUGURATING THE NATIONAL CONFERENCE ON HIGHWAY EQUIPMENT', 'NEW DELHI', 'Delhi', 'NEW DELHI', '110001', 'SHRI NITIN GADKARI INAUGURATING THE NATIONAL CONFERENCE ON HIGHWAY EQUIPMENT', NULL, 28.6327, 77.2196, '2015-07-09 14:37:00', '2015-07-09 14:37:00', '1441962479-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-09-11 11:28:43'),
(18, 13, 'ENG', 'SHRI. NITIN GADKARI ADDRESSING HIGHWAYS CONFERENCE IN GUWAHATI ', 'GUWAHATI ', 'Assam', 'GUWAHATI ', '781001', 'SHRI. NITIN GADKARI ADDRESSING A CONFERENCE ON KEY CHALLENGES IN HIGHWAYS & INFRASTRUCTURE CONSTRUCTION IN THE NORTH-EASTERN REGION AND USE OF INNOVATIVE TECHNOLOGIES AND MATERIALS IN GUWAHATI ON JUNE 30, 2015', NULL, 26.1827, 91.7498, '2015-06-30 14:47:00', '2015-06-30 14:47:00', '1441963110-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-09-11 11:28:51'),
(20, 13, 'ENG', 'INAUGURATION CEREMONY OF THE BIO-DIESEL DISPENSING UNIT, AT HALDIA DOCK  ', 'HALDIA DOCK COMPLEX', 'West Bengal', 'Haldia', '721607', 'SHRI NITIN GADKARI UNVEILING THE PLAQUE TO INAUGURATE THE BIO-DIESEL DISPENSING UNIT, AT HALDIA DOCK COMPLEX, WEST BENGAL ON JUNE 24, 2015.', 'http://www.bjp.org/en/media-resources/photo-gallery/2015/june/union-minister-for-road-transport-highways-and-shipping-shri-nitin-gadkari-unveiling-the-plaque-to-inaugurate-the-bio-diesel-dispensing-un', 22.0418, 88.0907, '2015-06-24 15:45:00', '2015-06-24 15:45:00', '1441966740-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-09-11 11:29:14'),
(21, 13, 'ENG', 'SHRI NITIN GADKARI AT JABALPUR', 'JABALPUR', 'Madhya Pradesh', 'JABALPUR', '482004', 'SHRI NITIN GADKARI, MINISTER OF ROAD TRANSPORT HIGHWAYS & SHIPPING LAYING THE FOUNDATION STONE OF NINE HIGHWAY PROJECTS OF 601 KMS AT JABALPUR, MADHYA PRADESH ON JUNE 20 2015', 'https://twitter.com/nitin_gadkari/status/612209268607967232', 23.2147, 79.9528, '2015-06-20 16:05:00', '2015-06-20 16:05:00', '1441967806-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-09-11 11:42:59'),
(22, 16, 'ENG', 'Brijmohan Agarwal at Kumbh Prayers for Rains in Chattisgarh', 'Raipur,Chattisgarh', 'Chhattisgarh', 'Raipur', '492001', 'Raipur, the state\'s charitable agriculture minister Brij Mohan Agarwal today worshiped on the banks of Godavari in Nashik and took the auspicious Kumbh bath, he prayed to God  for happiness, peace and prosperity in Chhattisgarh state. ', 'http://brijmohanagrawal.in/news#prettyPhoto', 21.233, 81.6583, '2015-09-10 12:41:00', '2015-09-10 12:41:00', '1442214733-em.png', 'Image', 0, 0, 0, 0, 1, '2015-09-14 07:12:38'),
(23, 16, 'ENG', 'Students and schools make good civic responsibility  Brijmohan', 'Raipur', 'Chhattisgarh', 'Raipur', '492001', 'If the Country has to succeed further we need to provide quality education  Currently standing academic traditions will benefit neither country nor the society Currently standing academic traditions will benefit neither country nor the society . Because the purpose of education today seems to be to get a job for only the best package, while being a good citizen first objective should be to contribute to the development of the country .', 'http://brijmohanagrawal.in/news-view/', 21.233, 81.6583, '2015-08-23 12:56:00', '2015-08-23 12:57:00', '1442215668-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-09-14 10:45:50'),
(24, 16, 'ENG', 'Proceed with nationalist ideology, will make India again a World Leader  Brijmohan', 'Chattisgarh', 'Chhattisgarh', 'Chattisgarh', '492001', 'State Agriculture - Water Resources Minister Brij Mohan Agarwal said while addressing the party workers , we take inspiration from the glorious history of our homeland , our country was once called golden bird and it had a sense of well-being every where,  the world used to learnt from us but we  got caught in the shackles of slavery.', 'http://brijmohanagrawal.in/news#prettyPhoto', 21.233, 81.6583, '2015-08-18 13:04:00', '2015-08-18 13:04:00', '1442216112-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-09-14 07:35:13'),
(25, 18, 'ENG', 'Launching ceremony of DD Kisan Channel', 'New Delhi', 'Delhi', 'New Delhi', '110002', 'The Prime Minister, Shri Narendra Modi being welcomed by the Minister of State for Information & Broadcasting, Col. Rajyavardhan Singh Rathore on his arrival at the launching ceremony of DD Kisan Channel, in New Delhi on May 26, 2015.', NULL, 28.6352, 77.2469, '2015-05-26 17:06:00', '2015-05-26 17:06:00', '1442403461-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-09-16 11:38:43'),
(26, 18, 'ENG', 'Workshop on Streamlining Government Communication', 'New Delhi', 'Delhi', 'New Delhi', '110002', 'The Minister of State for Information & Broadcasting, Shri Rajyavardhan Rathore at the inaugural session of the workshop on \'Streamlining Government Communication, on February 02, 2015.', NULL, 28.6352, 77.2469, '2015-02-02 17:11:00', '2015-02-02 17:11:00', '1442403757-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-09-16 11:49:30'),
(27, 18, 'ENG', 'BES EXPO-2015', 'Pragati Maidan, New Delhi', 'Delhi', 'New Delhi', '110001', 'The Minister of State for Information & Broadcasting, Shri Rajyavardhan Rathore at the inauguration of the BES EXPO-2015 - 21st International Conference & Exhibition on Terrestrial and Satellite Broadcasting,on January 15, 2015.', 'http://www.besindia.com/PDF/BES%202015%20Brochure.pdf', 28.616, 77.2444, '2015-01-15 17:22:00', '2015-01-15 17:22:00', '1442404395-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-09-16 11:57:37'),
(28, 18, 'ENG', 'National Youth Festival 2015', 'New Delhi', 'Delhi', 'New Delhi', '110001', 'The Minister of State for Information & Broadcasting,Shri Rajyavardhan Rathore addressing at the closing function of the 19th National Youth Festival, on January 12, 2015.', NULL, 28.6327, 77.2196, '2015-01-12 17:25:00', '2015-01-16 17:25:00', '1442404604-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-09-16 11:58:03'),
(29, 18, 'ENG', 'Release of Govt of India Calendar 2015', 'New Delhi', 'Delhi', 'New Delhi', '110001', 'The Minister of State for Information & Broadcasting, Shri Rajyavardhan Rathore at the release function of the Government of India Calendar 2015 on December 17, 2015.', NULL, 28.6327, 77.2196, '2014-12-17 17:29:00', '2015-12-17 17:30:00', '1442404897-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-09-16 12:01:37'),
(30, 18, 'ENG', 'Multimedia Exhibition on Former PM Shri Atal Bihari Vajpayee', 'New Delhi', 'Delhi', 'New Delhi', '110001', 'The Minister of State for Information & Broadcasting, Shri Rajyavardhan Rathore at the inauguration of the Multimedia Exhibition on the former Prime Minister, Shri Atal Bihari Vajpayee on December 20, 2014.', 'http://delhinewsagency.com/multimedia-exhibition-on-the-former-pm-shri-atal-bihari-vajpayee/', 28.6327, 77.2196, '2014-12-20 17:34:00', '2014-12-20 17:34:00', '1442405111-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-09-16 12:05:11'),
(31, 23, 'ENG', 'Dr. Raman Singh: Chief Minister inaugurates three-day Raipur Literature Fest', 'Raipur', 'Madhya Pradesh', 'Raipur', '492001', 'Diversity in perspectives gives birth to new thoughts.', NULL, 21.2514, 81.6296, '2014-12-12 09:00:00', '2014-12-12 11:00:00', '1450165816-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-12-15 07:50:16'),
(32, 23, 'ENG', 'Navratri Festival signifies women power ', 'Raipur', 'Madhya Pradesh', 'Raipur', '492001', 'Chief Minister of Chhattisgarh Dr Raman Singh has greeted people on beginning of auspicious festival- Shardiya Navratri. In his message to public, Chief Minister has stated that this festival of worshipping nine avatars of Ma Durga on each of the nine days signifies women power in Indian culture. Dr Raman Singh said that Chhattisgarh also has the age-old tradition of \'Shakti Puja\'. Temples such as Bamleshwari Temple Dongargarh, Mahamaya Temple Ratanpur and Ambikapur, Danteshwari Temple Dantewada, Ganga Maiya Temple Jhalmala, Chandrahasini Temple Chandrapur, etc are the major centre of belief for devotees. Chief Minister has welcomed thousands of devotees visiting these centres of belief on the occasion of Shardiya Navratri and has extended best wishes for celebration of the festival. Dr Singh has instructed administrative officials of respective districts to arrange for all the necessary facilities for devotees visiting these temples. Dr Raman Singh said that on this auspicious festiva', NULL, 21.2514, 81.6296, '2015-10-12 10:00:00', '2015-10-12 12:00:00', '1450166096-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-12-15 07:54:56'),
(33, 23, 'ENG', 'Mana Camp pond will be developed into \'Model\' one', 'Raipur', 'Madhya Pradesh', 'Raipur', '492001', 'Chief Minister Dr. Raman Singh today assured a delegation of visitors that the pond (Talab) located near Nagar Panchayat Mana Camp will be developed into a model one. The delegation was led by Nagar Panchayat President Mr. Shyama Prasad Chakraborthy. They met Chief Minister Dr. Raman Singh at the weekly \'Jan-Darshan\' programme at his official residence. He directed the memorandum   to Urban Administration and Development Minister Mr.  Amar Agrawal', NULL, 21.2514, 81.6296, '2015-10-08 16:00:00', '2015-10-08 18:00:00', '1450166342-em.jpg', 'Image', 0, 0, 0, 0, 1, '2015-12-15 07:59:02'),
(34, 26, 'ENG', 'Jonbeel Mela ', 'Morigaon', 'Assam', 'Morigaon', '782410', 'Chief Minister Tarun Gogoi said that Jonbeel Mela is a great melting pot where people from all walks of life converge and forge a unifying force which has the potential to tame divisive forces.\r\n\r\nAddressing a gathering at Junbeel Mela at Morigaon on Saturday, Gogoi said that at Junbeel Mela people from all ethnicities converge and forge a greater understanding which has the potential to foil any evil design of divisive forces. Gogoi said, Some divisive forces are hell bound to create division in the society in the name of caste, creed and religion to fulfil their narrow gains adding that he said, Such forces need to be controlled for the State to go forward and expedite its development.', 'http://www.nelive.in/photo/north-east/news/photo-gallery-jan-23-2016', 26.1844, 92.229, '2016-01-23 18:15:00', '2016-03-30 18:15:00', '1453898472-em.png', 'Image', 0, 0, 0, 0, 1, '2016-03-26 10:17:15'),
(36, 26, 'ENG', '12th South Asian Games, 2016', 'Sarusajai Stadium', 'Assam', 'Guwahati', '781028 ', 'The 12th South Asian Games started on 5th February 2016 in Guwahati and Shillong received a positive response with sports fanatics thronging the stadium to enjoy the twelve days of sporting activities in the spirit of friendship, togetherness and much more.\r\n\r\nWith 4500 participants, including 2600 athletes in 22 disciplines from 8 countries, the event has been widely hailed as the best South Asian Games, ever organised.\r\nA huge credit goes to Shri Tarun Gogoi, the honourable Chief Minister of Assam and Shri Mukul Sangma, the honourable Chief Minister of Meghalaya. The Government of India, the Government of Meghalaya and the Government of Assam worked in unison to bring the Games to the two cities', 'http://www.tarungogoi.in/pressrelease.php?displaytype=Press&displayid=PR-102846', 26.1218, 91.8001, '2016-02-05 18:20:00', '2016-02-16 18:20:00', '1453898596-em.png', 'Image', 0, 0, 0, 0, 1, '2016-03-25 11:19:26'),
(40, 26, 'ENG', 'CM Tarun Gogoi addressing at Titabor constituency', 'Titabor ', 'Assam', 'Jorhat', '785630', 'Assam Chief Minister Tarun Gogoi addressed a party worker\'s meeting in  Titabor constituency organised by Titabor Block Congress Committee for the filing of  nomination of candidature for Assam Assembly polls 2016\r\n\r\n', NULL, 26.5881, 94.1872, '2016-03-17 00:00:00', '2016-03-17 00:00:00', '1458282573-em.jpg', 'Image', 0, 0, 0, 0, 1, '2016-03-22 12:20:40'),
(47, 26, 'ENG', 'Shri Tarun Gogoi filing nomination from Titabor', 'Titabor', 'Assam', 'Jorhat', '785630', 'Chief Minister Tarun Gogoi filed his nomination from his home constituency, Titabor today.  Addressing to a mass of supporters at the rally, Shri Tarun Gogoi asserted that he would continue to strive for excellence in the State.\r\n \'\'My victory depends on the love & blessings of the people of Titabor who have made us victorious in the previous 3 terms.\r\nI have always had immense faith in my party workers, we will win again this time & this will be the victory of the people of Titabor.\" CM quoted.', NULL, 26.5881, 94.1872, '2016-03-18 18:54:00', '2016-03-18 18:54:00', '1458307651-em.jpg', 'Image', 0, 0, 0, 0, 1, '2016-03-26 11:26:40'),
(51, 26, 'ENG', 'Launch of Election Manifesto ', 'Rajiv Bhavan', 'Assam', 'Guwahati', '781005', 'Shri Tarun Gogoi launched the Election Manifesto yesterday on the auspicious day of Holi.\r\n \'\'In our next term, we will stress more on job creation. No other state has matched number of jobs created. \r\nWe will give unemployment allowances of Rs 1000 each to most needy & set up innovation centres with venture capital of Rs 5500 cr. We will\r\nhold pre-selection tests for Paramilitary, Air Force, Navy, Railways & other sectors & also provide coaching centers for them. We will ensure registration of the unemployed youths of every district to train & counsel them. Opening of community kitchen for each village & adding breakfast along with the scheme of Mid-day meals will be some of our new initiatives.\'\' CM quoted', NULL, 26.1573, 91.7953, '2016-03-24 17:00:00', '2016-03-24 18:00:00', '1458884073-em.jpg', 'Image', 0, 0, 0, 0, 1, '2016-03-28 11:04:13'),
(52, 26, 'ENG', 'A thought-provoking speech by Shri Tarun Gogoi', 'Makum', 'Assam', 'Tinsukia', '785630', 'A huge crowd could be seen at a rally in Makum in the district of Tinsukia yesterday, where Shri Tarun Gogoi made his thought provoking speech assuring them he would bring more development  to the district of Tinsukia and in the state of Assam. ', NULL, 27.4864, 95.376, '2016-03-26 11:00:00', '2016-03-26 12:00:00', '1459053016-em.jpg', 'Image', 0, 0, 0, 0, 1, '2016-03-31 06:19:10'),
(54, 26, 'ENG', 'Shri Tarun Gogoi in Doom Dooma', 'Doom Dooma', 'Assam', 'Tinsukia', '786151', 'After meeting the people of Makum, Shri Tarun Gogoi proceeded to Doom Dooma yesterday, to meet his supporters and assuring them he would continue to bring more development in the state in his next term.\r\n\r\nThe huge crowd at the rally proved that they are with Shri Tarun Gogoi and they  were seen cheering the CM when he was delivering his inspiring speech. ', NULL, 27.5664, 95.5552, '2016-03-26 13:00:00', '2016-03-26 14:00:00', '1459055791-em.jpg', 'Image', 0, 0, 0, 0, 1, '2016-03-31 06:06:44'),
(55, 26, 'ENG', 'Shri Tarun Gogoi in Borholla addressing the mass', 'Borholla', 'Assam', 'Jorhat', '785631', 'Shri Tarun Goigoi arrived in Borholla some time ago to meet the people over there.\r\n\r\n\"Today I have come to this rural area and want to thank you all for my victory for the last three terms. My birth and childhood in Tea gardens and villages here have given me an understanding of the pain and problems of the rural areas\" Mr. Gogoi quoted.\r\n\r\nMr Gogoi further added \"I might be old but I have the strength to work for the state. We are stressing on rural development and for that we will take initiative to set up small scale industries.Our victory is obvious\"', NULL, 26.4507, 94.1539, '2016-03-27 11:30:00', '2016-03-27 00:00:00', '1459062488-em.png', 'Image', 0, 0, 0, 0, 1, '2016-03-28 08:56:00'),
(57, 26, 'ENG', 'Unity is Diversity', 'Titabor', 'Assam', 'Jorhat', '785630', 'Members from 33 masjid came together at Bahadur Gaonburha Islamic Multipurpose Project, Titabor and prayed for the victory of Shri Tarun Gogoi as a Chief Minister of Assam for the 4th term in the upcoming assembly election.\r\n\r\nVisit Gallery for more images.', NULL, 26.5881, 94.1872, '2016-03-27 13:30:00', '2016-03-27 14:30:00', '1459070457-em.png', 'Image', 0, 0, 0, 0, 1, '2016-03-28 08:52:07'),
(59, 26, 'ENG', 'CM at the rally in Bokajan', 'Bokajan', 'Assam', 'Karbi Anglong', '782480', 'Shri Tarun Gogoi felt overwhelmed by seeing the huge crowd waiting to have a glimpse of their Chief Minister.\r\n\r\n\r\nVisit Gallery for more images.\r\n\r\n\r\n', NULL, 26.022, 93.7752, '2016-03-28 13:00:00', '2016-03-28 13:59:00', '1459153895-em.jpg', 'Image', 0, 0, 0, 0, 1, '2016-03-28 11:08:15'),
(60, 26, 'ENG', 'Hon\'ble CM wowed the public with his speech at Rangapara', 'Rangapara', 'Assam', 'Sonitpur', '784505', 'After meeting the people of Bokajan and Bihali, the dynamic Shri Tarun Gogoi continues his trip to Rangapara of Sonitpur district  to address the public, who is eagerly waiting for him.\r\n\r\nVisit Gallery for more images.', NULL, 26.8125, 92.6934, '2016-03-28 15:03:00', '2016-03-28 16:03:00', '1459161420-em.jpg', 'Image', 0, 0, 0, 0, 1, '2016-03-31 05:54:11'),
(61, 26, 'ENG', 'A myriad of supporters at the Diphu rally', 'Diphu', 'Assam', 'East Karbi Anglong', '782460	', 'Men, women & a group of youth thronging at the Diphu rally to listen to the speech of Shri Tarun Gogoi. The people are very hopeful that this time also Shri Tarun will stand victorious in the upcoming assembly election.\r\n\r\nMr. Gogoi quoted addressing the crowd, \'\' We are for the development of every community and religion and with the same objective of development we have formed development council. We want development of Karbi Anglong, North Cachar and people will vote for us.\"\r\n\r\nMr. Gogoi further added, \" Unemployment is a crucial issue in Karbi Anglong and we will bring special schemes to solve this problem. We will set up industries to solve unemployment here and special package will be given to the people of Karbi Anglong.\"', NULL, 25.8465, 93.4299, '2016-03-29 12:30:00', '2016-03-29 13:30:00', '1459237145-em.png', 'Image', 0, 0, 0, 0, 1, '2016-03-30 08:18:45'),
(62, 26, 'ENG', 'Shri Rahul Gandhi joining Shri Tarun Gogoi at Diphu', 'Diphu', 'Assam', 'East Karbi Anglong', '782460', 'AICC Vice President, Shri Rahul Gandhi joined Shri Tarun Gogoi at the Diphu rally. Shri Rahul Gandhi regretted arriving late due to the bad weather condition however he felt delighted amid the crowd of cheering people at the rally. ', NULL, 25.8465, 93.4299, '2016-03-29 13:45:00', '2016-03-29 14:15:00', '1459246133-em.jpg', 'Image', 0, 0, 0, 0, 1, '2016-03-31 07:24:28'),
(63, 26, 'ENG', 'Mr. Tarun Gogoi and Mrs. Sonia Gandhi being welcomed at Biswanath Chariali', 'Biswanath Chariali', 'Assam', 'Sonitpur', '784176', 'Crowd flocking at the rally in Biswanath Chariali of Sonitpur district to  welcome wholeheartedly both Mrs. Gandhi and Mr. Gogoi.\r\n\r\n\r\n\r\nVisit Gallery for more images.', NULL, 26.7847, 92.922, '2016-03-30 14:00:00', '2016-03-30 15:30:00', '1459329916-em.jpg', 'Image', 0, 0, 0, 0, 1, '2016-03-30 13:08:51'),
