INSERT INTO `contributionoffers` (`ContributionOfferID`, `ContributorID`, `OfferCategoryID`, `OfferThumbnail`, `OfferTitle`, `OfferDetailTitle`, `OfferDetailImage`, `Punchline`, `OfferDescription`, `OfferTermsandConditions`, `OfferType`, `TotalCoupons`, `OfferLocation`, `OfferLat`, `OfferLong`, `Priority`, `IsActive`, `DisplayStatus`, `OfferStarttimestamp`, `OfferEndtimestamp`, `createdtimestamp`, `updatedtimestamp`) VALUES
(1, 1, 8, '1438777593-thmb.jpg', 'Buy One Pizza and Get 50% OFF Second Pizza', 'Dominos at Nagpur', '1438781717-det.jpg', NULL, 'Find dozens of Dominos coupons, discount coupons, coupon codes, promo codes, ... Mom & Me. Exclusive: Get ? 500 off on a Purchase Worth 1500. Dominos at nagpur ... ', 'Note: Offer valid only on Medium Pan Signature & Supreme pizza.\r\n \r\nPizza Hut is an American restaurant chain and international franchise, known for pizza and side dishes. Every Sunday Pizza hut India offers buy 1 get 1 free on Medium size pizza on online order or takeaway.', '1', 10, 'Plot No.1, Mate Square, South Ambazari Road, Madhav Nagar, Nagpur', 21.122, 79.0567, 0, 1, '1', '2015-08-05 00:00:00', '2016-02-29 00:00:00', '2015-08-05 12:19:59', '2015-11-25 11:39:57'),
(2, 2, 8, '1438778247-thmb.jpg', 'Five Star Hotels in Nagpur', 'Radisson Blu at Nagpur', '1438777721-det.jpg', NULL, 'This upscale modern hotel, set south of the city centre, is 4.5 km from the Deekshabhoomi monument and 6 km from Maharajbagh zoo. \r\n\r\nThe sophisticated rooms come with free Wi-Fi, city or pool views and 42-inch flat-screen TVs. All also feature 24/7 room service, desks and minibars, along with tea and coffeemaking facilities. Club-level rooms add whirlpools and access to a private lounge, and suites offer separate living rooms.', 'Amenities include free parking, 3 stylish restaurants, a bar and an upmarket spa. There\'s also an outdoor pool, a fitness room and a business centre, in addition to meeting facilities.\r\n', '1', 25, ' 7 , Wardha Road, Nagpur, Maharashtra 440015', 21.1188, 79.0726, 0, 1, '1', '2015-08-05 00:00:00', '2015-10-01 00:00:00', '2015-08-05 12:24:47', '2015-09-16 10:55:38'),
(5, 5, 9, '1438779217-thmb.jpg', 'Up to 50% Off Daily Travel Deals ', 'Golden Holidays Tours & Travels', '1438778891-det.jpg', NULL, 'Thailand is one the most visited countries in Asia and is renowned for its charming culture, beautiful sandy beaches, Thai culinary delicacies and some amazing tourist attractions. Enjoy the highlights of Thailand and experience Bangkok and Pattaya  the two most vibrant cities...', 'Cancellation policy:\r\nNo refund if booking is confirmed \r\n\r\nCrazeal Promise:\r\nIf desired reservation dates are unavailable, contact us within 14 days for full refund - No questions asked!', '0', 0, '217,Bajaj Nagar,Behind Vijay Bank,South Ambadhari Road, Nagpur-440012', 21.1418, 79.0843, 0, 1, '1', '2015-08-05 00:00:00', '2015-08-29 00:00:00', '2015-08-05 12:48:11', '2015-08-05 12:53:37'),
(6, 3, 9, '1438779113-thmb.jpg', 'Get 100% Cashback on Your Rides', 'Taxi For Sure', '1438779405-det.png', NULL, 'Worth Rs 150 Free when you book your Ride and pay with your paytm wallet. Use code while signing up on the app. Please note that this is a sign-up code & not a ride code. Post signing-up using the code.', 'Rs 150 credits get added in your TFS credits (in payments section). TFS credits get utilized on any rides booked thereafter using the app. Ride Now.', '1', 10, 'Nagpur', 21.1458, 79.0882, 0, 1, '1', '2015-08-05 00:00:00', '2016-02-29 00:00:00', '2015-08-05 12:50:00', '2015-11-25 11:40:08'),
(7, 6, 1, '1438780113-thmb.jpg', '88% OFF Beauty Consultation', 'VLCC Wellness - Nagpur', '1438780113-det.jpg', NULL, 'Relaxation is one of the elemental forces that keeps human bodies alive, alongside air, water, fire and earth. Ease into your element with today\'s deal for a LOreal or Wella hair spa, a beauty consultation, manicure, pedicure and a gold/wine/mineral or fruit facial. ', 'General Fine Print:\r\nVoucher is valid from  25th January to 25th February, 2012\r\nOffer is only for ladies\r\nService duration: Up to 2 hours\r\nPrior reservation mandatory', '1', 10, 'Nagpur', 21.1458, 79.0882, 0, 1, '1', '2015-08-05 00:00:00', '2016-02-29 00:00:00', '2015-08-05 13:08:33', '2015-11-25 11:40:26'),
(8, 7, 17, '1441870270-thmb.jpg', 'Buy One Pizza and Get 50% OFF Another Pizza', 'Dominos at Nagpur', '1441870270-det.jpg', NULL, '', '', '1', 10, '', 0, 0, 0, 1, '1', '2015-09-10 00:00:00', '2015-10-30 00:00:00', '2015-09-09 12:53:35', '2015-09-10 07:31:54'),
(9, 8, 17, '1441803311-thmb.jpg', 'Rajdhani Thali', 'Moti Mahal Restaurant, Sadar, Nagpur', '1441803311-det.jpg', NULL, 'There comes a time when every Indian must satisfy his/her craving for authentic Indian food. Your time is now. Todays Crazeal brings you a mouth-watering feast for 2 at Rajdhani Restaurant - The Vegetarian Thali Restaurant.Rajdhani Restaurant, which is the flagship brand.', 'General Fine Print:\r\nValid until 16 June, 2012\r\nValid 7 days a week - 12:00 Noon to 11:00PM \r\nValid for 2 persons\r\nPrior reservation mandatory. Rescheduling may result in additional charges\r\nVoucher printout is mandatory', '1', 25, 'Residency Road, Sadar, Nagpur, Maharashtra 440001', 21.1608, 79.0796, 0, 1, '1', '2015-09-08 00:00:00', '2016-02-29 00:00:00', '2015-09-09 12:55:11', '2015-11-25 05:54:53'),
