(44, 44, 'No doubt you have done quite a lot of work. I m 60% satisfied. If u are voted to power for 4th term, I would like to see one engineering college in every district. Invite reputed institutes like manipal, SRM , Amity etc to set up educational institutions in Assam. Provide govt land on lease n keep 30 seats reserved for poor n meritorious candidates. Stress on IT sector. This sector can bring lots of changes. Guwahati should be developed as 3rd IT hub in the East after kolkata n Bhubaneswar. 50k IT jobs can create indirect oppourtunity to 2lac ppl. IT boom will lead to real estate boom, tourism n hospitality boom, retail boom n other n number of booms. For this to happen power is important. Go for solar parks across ASSAM. You can use vast land of Brahmaputra to set up big solar factories. Build pillars inside Brahmaputra n set up huge solar panels.', '2016-03-24 19:25:45', 254, 0),
