INSERT INTO `journey` (`journeyID`, `LanguageCode`, `biography`, `principle`, `philosophy`, `sandesh`, `CMSUserAuthenticationID`, `LastUpdatedDate`, `bioBannerPath`, `principleBannerPath`, `philosophyBannerPath`, `sandeshBannerPath`) VALUES
(12, 'ENG', '\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p class=\"MsoNormal\">Dr. Uday Singh Deshmukh better known as Sadguru Shri Bhaiyyuji Maharaj, is a Saint by all the dictionary definitions, The\r\nhandsome, well built, charismatic, learned, talented and gifted Guru is in his\r\nearly thirties and has been well recognized as the Rastra Saint (<span style=\"font-family:&quot;Mangal&quot;,&quot;serif&quot;\"></span> <span style=\"font-family:\r\n&quot;Mangal&quot;,&quot;serif&quot;\"></span>), from his age of five The Saint is always\r\ncompassionate towards the woes and worries of the people. The woes and worries\r\ncould be physical, spiritual or otherwise; but a Saint is concerned about\r\nproviding solace to the difficulties faced by the common man. Param Pujya\r\nBhaiyyu Maharaj performs each and every of these but does some things neigh\r\nmany more than these.</p>\r\n\r\n<p class=\"MsoNormal\">Uday Singh Deshmukh (born 29 April 1968) usually known as\r\nBhaiyyu Maharaj &amp; Gurudev, is a spiritual guru &amp; founder of Shri\r\nSadguru Datta Dharmik Evam Paramarthik Trust Indore which aims at serving\r\nhumanity in various ways. He is well known among Political circles of\r\nMaharashtra, Madhya Pradesh &amp; Gujrat. Under his guidance the trust does a\r\nhuge amount of work to uplift the backward, downtrodden &amp; poor sections in states\r\nof Maharashtra, Madhya Pradesh &amp; Gujarat.</p>\r\n\r\n<p class=\"MsoNormal\">At the age of 37, he is considered one of the youngest\r\nspiritual teachers in the world. We are the blessed and the most fortunate ones\r\nto be under the spiritual guidance of Guru Bhaiyyu Maharaj.Bhaiyyu Maharaj has\r\nset up Ashrams in various cities in Maharashtra and Madhya Pradesh. The main\r\nAshram situated in Indore, SHRI SADGURU DATTA DHARMIK EVAM PARMARTHIK TRUST,\r\nlocated at BH-16, Pandit Dindayal Upadhyay Nagar (Bharat Mata Mandir) Sukhlia,\r\nIndore. The Ashram is a center where numerous spiritual and social projects and\r\ndiscussions are continuously held. Hundreds of devotees visit the Ashram to pay\r\ntheir respects and receive his blessings. It is strongly believed (and\r\nexperienced) by his devotees that Bhaiyyu Maharaj looks to the welfare of his\r\ndevotees. There are many instances reported by his devotees and disciples of\r\nhis appearing in their midst during crises.</p>\r\n\r\n<p class=\"MsoNormal\">Bhaiyyu Maharaj has his headquarters in Indore, though he\r\ndoes not stay here always. He mainly tours Maharashtra for development of\r\nprojects where he has numerous disciples and devotees who organize discourses\r\non spiritual and practical ways of life.</p>\r\n\r\n<p class=\"MsoNormal\">Awards Won:</p><p class=\"MsoNormal\">(1) Doctor of Literature from the D. Y. Patil University, (Kolhapur) 2016</p><p class=\"MsoNormal\">(2) Ahinsha Ratan Award, 2013</p><p class=\"MsoNormal\">(3)Rajiv Gandhi Excellence Award, 2014</p><p class=\"MsoNormal\">(4)Vidharbh Bhooshan Award, 2016</p><p class=\"MsoNormal\">(5) Indore Ratan Award, 2015</p>\r\n\r\n<p class=\"MsoNormal\"><br></p>', '<p class=\"MsoNormal\">Principles bring concentration in life. Principles get Ganga\r\nin our life by way of concentration and aim. The Ganga brings fulfillment by\r\ncontinuous pleasure and generate self-satisfaction in life. Everybody wants\r\nthat his life to be peaceful and contended. One decides principles with\r\nreference to need of epoch, that it be aim of attainment of supreme lord or aim\r\nof service of society. Everyone does have principles in life. The one whose\r\nprinciples are based on human values and think about social welfare are called\r\nas seers on this earth. Param Pujya Gurudev always thinks about welfare of\r\nsociety.</p><p class=\"MsoNormal\">Gurudev though looks simple in behavior, but observes the\r\nfollowing principles profoundly.</p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"font-stretch: normal; font-size: 7pt; font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></span><!--[endif]-->For achieving good aim positive thinking is\r\nessential. </p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"font-stretch: normal; font-size: 7pt; font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;</span></span><!--[endif]-->To bring subtleness in practice it is essential\r\nto have source of temperament i.e. Bhav Tatva. </p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"font-stretch: normal; font-size: 7pt; font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></span><!--[endif]-->One shall not permit devaluation of character. </p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"font-stretch: normal; font-size: 7pt; font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></span><!--[endif]-->One shall not use abusive language to anybody.</p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"font-stretch: normal; font-size: 7pt; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->By way of Sankaras we can get rid of bad values\r\nand bad deeds from our consciousness. </p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"font-stretch: normal; font-size: 7pt; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->Youth is the most precious wealth of nation.</p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"font-stretch: normal; font-size: 7pt; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->The development of character of persons should\r\ngo beyond religion, caste, sects or political associations.</p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"font-stretch: normal; font-size: 7pt; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->Personality development of child gets triggered\r\nfirst from home </p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"font-stretch: normal; font-size: 7pt; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->In personal life, instead of running after\r\nglittering materialism one should balance the situation.</p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"font-stretch: normal; font-size: 7pt; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->Try to build character. Dont waste life for\r\njust lust, desires and greed. </p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol\"><span style=\"font-stretch: normal; font-size: 7pt; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]-->Understand the purpose of your life and make it\r\nmeaningful for others too.</p>', '<p class=\"MsoNormal\">Dharma of sun is to impart energy to universe as soon it\r\nrises. Magnanimity of its light is bestowed upon both living and unanimated\r\nequally. Suns rays swallow darkness of life.</p>\r\n\r\n<p class=\"MsoNormal\">Sun is inspiration and symbol for the detached actions\r\n(Nishkam Karma). Sun never bothers about who is benefited by its rays of light.\r\nSun is goddess exemplifying sacrifice, dedication, magnificence, service and\r\ndetached action. Inspired by suns goodness, in this short life span let us do\r\nsome good work for meaningful existence in society. Similarly duty of mankind\r\nis a chain of personnel relationship, strong base, warmth, love and self\r\nrespect which joins them together as well as fulfills nation, society and\r\nhumanism.</p>\r\n\r\n<p class=\"MsoNormal\">Today there are many problems and misfortunes in society.\r\nWhich are like gloom of darkness surrounds all of us. We need energy of virtues\r\n(Sadgunas) to come out of such glooms. We need to adopt work approach based on\r\nvirtues by which not only we can develop ourselves but also society and nation.\r\nToday above thoughts can be imbibed and strengthen by elderly persons\r\nshouldering their responsibility and younger ones as their duty. Wherever caste\r\nbased political leadership is at the center stage, development cannot follow right\r\nkind of trajectory. Our small quantum of effort in right direction can be\r\nimmensely helpful in development of society. We need to enhance the horizons of\r\nour thinking. We are born on this land, family and society has supported us,\r\nalso ignited lamp of values so as to create true personality. If so then we\r\nneed to think about our society and guide our efforts for its development.\r\nEgoless person can only work for society, nation and humanity. One can\r\nunderstand others only if himself devoid of ego.</p>\r\n\r\n<p class=\"MsoNormal\">Let us together create India, where every household is full\r\nof bliss and enlightened by the light of values welcoming sunrise (Suryodaya).\r\nThis is our Suryodaya Dharma.</p>', '<p class=\"MsoNormal\">Our country is celebrating its 60<sup>th</sup> Independence\r\nyear, six decades is quite a time for a nation to grow and flourish. India has\r\ncome to the helm of development and has grown as a super power. We have\r\ndeveloped in the field of Information Technology, Industry, Science, and\r\nEducation. It can be seen that we have achieved ultimate development in almost\r\non all the fronts but unfortunately we have failed in creating awareness of\r\nhumanity and its developments. </p>\r\n\r\n<p class=\"MsoNormal\">The nation is facing problems like insurgency, female\r\nfoeticide, illiteracy, suicides by farmers, malnutrition, religious\r\nfundamentalism, environmental imbalance, class conflicts, crime, unemployment\r\netc. Every individual is attracted towards the materialistic world and has\r\nbecome self centered, he has little concern for the society and the nation. The\r\nsituation is alarming, we all ought to be seriously concerned and a collective\r\neffort has to be made.</p>\r\n\r\n<p class=\"MsoNormal\">India is one of the largest agricultural producers, its\r\nsocial fabric is necessarily agrarian, and still we are seeing the farmers\r\ncommitting suicide. The strength of a nation is seen in its children and youth.\r\nIndia is blessed with a strong population of youth; they constitute about 70%\r\nof the nations population.</p>\r\n\r\n<p class=\"MsoNormal\">Expecting mothers of our country are anemic, irrespective of\r\ntheir social and economical status. Women are seen as sources of strength and\r\npower, but this has not come in reality.</p>\r\n\r\n<p class=\"MsoNormal\"></p>\r\n\r\n<p class=\"MsoNormal\">The law of the soil has to be honored; a country with law\r\nabiding citizens is nothing less than a paradise. </p>\r\n\r\n<p class=\"MsoNormal\">Religion and spiritualism are the only ways to induce the\r\nflame of emotions, to make a being a true human. The knowledge of a particular\r\nfield makes him a believer of that field but ignorance of a particular field\r\nmakes him an atheist.</p>\r\n\r\n<p class=\"MsoNormal\">I dream of seeing my motherland seated on the throne of\r\nbeing Jagadguru. I dream of having a fearless society dedicated towards the\r\nnation, striving to make it stronger, economically, ethically, healthy,\r\ncivilized, and intellectually competent. I want to see that Education, Health\r\nand Religion percolate down to the grass root of the society, to the last\r\nliving soul of my motherland. I know it\'s a huge task but definitely not impossible.\r\nI wish that we all join hands together and make this crusade successful. Let us\r\nall have our Motherland of our dreams; not all are that fortunate to repay\r\ndebts. It is really an aspect of pride to be born on this soil, the largest\r\ndemocracy in the world, the land that gave birth to philosophers, spiritual\r\nteachers, scientists and socialists. Thank you, Jai Hind, Jai Dharma.</p>', 32, '0000-00-00 00:00:00', '32-1466175708-plogo.jpg', '32-1466175708-pbanner.jpg', '32-1466175708-phbanner.jpg', '32-1466175708-hsbanner.jpg');
