INSERT INTO `party` (`partyID`, `LanguageCode`, `history`, `philosophy`, `leadership`, `partyName`, `partyWebsiteURL`, `CMSUserAuthenticationID`, `LastUpdatedDate`, `partyLogoPath`, `partyBannerPath`, `historyBannerPath`, `philosophyBannerPath`) VALUES
(1, 'ENG', 'The Indian National Congress (About this sound pronunciation INC, also commonly called the Congress is one of the two major political parties in India, the other being the Bharatiya Janata Party. It is one of the largest and oldest democratically-operating political parties in the world. The Organisation was founded during the British Colonial times in 1885. The founders included a prominent member of the Theosophical Society, Allan Octavian Hume, Dadabhai Naoroji and Dinshaw Wacha. In the following decades, the Indian National Congress became a pivotal participant in the Indian Independence Movement, with over 15 million members and over 70 million participants in its struggle against British colonial rule in India', 'From 200414, the Congress-led United Progressive Alliance, a coalition of several regional parties, formed the government, headed by Prime Minister Manmohan Singh. In November 2014, Congress was in power in ten states. In six statesArunachal Pradesh, Himachal Pradesh, Karnataka, Manipur, Meghalaya, and Mizoramthe party had a majority on its own. In three other statesAssam, Kerala and Uttarakhandit shared power with other alliance partners. Congress has previously directly ruled Andhra Pradesh, Tamil Nadu, Gujarat, Madhya Pradesh, Rajasthan, Punjab and Goa. In the general elections in 2014, the Congress registered its worst performance in a general election in independent India, winning only 44 seats of the 543-member house.', 'Rahul Gandhi', 'Indian National Congress', 'http://www.inc.in', 2, '0000-00-00 00:00:00', '', '2-1432359102-pbanner.jpg', '2-1432359102-hsbanner.jpg', '2-1432359102-phbanner.jpg'),
(2, 'ENG', 'The Bharatiya Janata Party is today the most prominent member of the family of organisations known as the \"Sangh Parivar\" and nurtured by the Rashtria Swyamsevak Sangh (RSS). Like the RSS, the BJP is wedded to Indias unity and integrity, its intrinsic identity and the social strength, individual character and cultural uniqueness that have been the hallmark of this great country and its people for millennia.\r\n\r\nHistory is the philosophy of nations. And the Sangh Parivar has a very clear and clear conception of Indian history.<div><br></div><div>Here was a great civilization whose influence and imprint spread from Sri Lanka to Tibet, from Southeast Asia to Central Asia, from one end of the Indian Ocean to the other. It weathered the storms of invaders, from the Greeks to the Huns, from the Shakas to the Islamic armies of Turks and Afghans. It fought and resisted external oppression and its essential civilization and culture survived great challenges and attempts at effacement. The glory of Vijayanagara and the heroism of Maharana Pratap, of a Shivaji and of a Guru Govind Singh are testimony to the Indian spirit.\r\n\r\nrashtriya swayamsewak sangh, rss logoIn more recent times this torch of nationalism and Indian identity was carried forward by Swami Dayanand and Swami Vivekanada. And in the present century the good work has been carried on by Sri Aurobindo, Lokmanya Tilak, Mahatma Gandhi and others. The RSS, founded by Dr K.B. Hedgewar in 1925 and consolidated by Shri Guruji M.S. Golwalkar after 1940, sees itself as the legatee of this heroic tradition. It believes in the principle of: \"Justice for all and appeasement of none\". It has no doubt about Hindu identity and culture being the mainstay of the Indian nation and of Indian society. This identity and this culture informs all Indians, irrespective of religious or denominational faith. To the RSS, all Indians, irrespective of religious background, notwithstanding their mode and place of worship, are equal.</div>', 'Ideologue and Teacher\r\n\r\nPandit Deendayal Upadhyaya (1916-1968)\r\n\r\nPandit Deendayal Upadhyaya was the leader of the Bharatiya Jana Sangh from 1953 to 1968. A profound philosopher, committed organization man and a leader who who maintained the highest standards of personal integrity and dignity in public life, he has remained a source of ideological guidance and moral inspiration for the BJP since its inception. His treatise Integral Humanism is a critique of both communism and capitalism. It provides a holistic alternative perspective for political action and statecraft consistent with the needs of the human race and the sustainability of our natural hab itat.\r\n\r\nA Short Biography\r\n\r\nPandit Deendayal Upadhyaya was born on September 25, 1916, in the sacred region of Brij  in the village of Nagla Chandraban in Mathura, in what is now Uttar Pradesh. An astrologer who studied his horoscope predicted that the boy would become a great scholar and thinker, a selfless worker, and a leading politician - but that he would not marry. Deendayalji experienced tragedy in his early years, losing his brother to illness in 1934. He later went to high school in Sikar (now in Rajasthan) where he excelled.<div><br></div><div>The then Maharaja of Sikar awarded Pandit Upadhyaya a gold medal, Rs. 250 for books and a monthly scholarship of Rs.10.\r\n\r\nDeendayalji passed his Intermediate exams with distinction in Pilani and left for Kanpur to pursue his B.A. and joined the Sanatan Dharma College. At the instance of his friend, Shri. Balwant Mahashabde, he joined the RSS in 1937. In the same year, he received his B.A. in the first division. Deendayalji then moved to Agra to pursue an M.A.</div>', 'Rajnath Singh (born 10 July 1951) is an Indian politician belonging to the Bharatiya Janata Party (BJP) who currently serves as the Home Minister of India. He previously served as the Chief Minister of the state of Uttar Pradesh and as a Cabinet Minister in theVajpayee Government. He has also served as the President of the BJP twice, 20052009 and 20132014. He began his career as a physics lecturer and used his long-term connections with the nationalist organisation, Rashtriya Swayamsevak Sangh to become involved with the Janata Party.', 'Bharatiya Janata Party', 'http://www.bjp.org/', 8, '0000-00-00 00:00:00', NULL, '8-1435842552-pbanner.jpeg', '8-1435844597-hsbanner.jpg', '8-1441785281-phbanner.jpg'),
(3, 'ENG', 'The Bharatiya Janata Party is today the most prominent member of the family of organisations known as the \"Sangh Parivar\" and nurtured by the Rashtria Swyamsevak Sangh (RSS). Like the RSS, the BJP is wedded to Indias unity and integrity, its intrinsic identity and the social strength, individual character and cultural uniqueness that have been the hallmark of this great country and its people for millennia. History is the philosophy of nations. And the Sangh Parivar has a very clear and clear conception of Indian history.\r\n\r\nHere was a great civilization whose influence and imprint spread from Sri Lanka to Tibet, from Southeast Asia to Central Asia, from one end of the Indian Ocean to the other. It weathered the storms of invaders, from the Greeks to the Huns, from the Shakas to the Islamic armies of Turks and Afghans. It fought and resisted external oppression and its essential civilization and culture survived great challenges and attempts at effacement. The glory of Vijayanagara and the heroism of Maharana Pratap, of a Shivaji and of a Guru Govind Singh are testimony to the Indian spirit. rashtriya swayamsewak sangh, rss logoIn more recent times this torch of nationalism and Indian identity was carried forward by Swami Dayanand and Swami Vivekanada. And in the present century the good work has been carried on by Sri Aurobindo, Lokmanya Tilak, Mahatma Gandhi and others. The RSS, founded by Dr K.B. Hedgewar in 1925 and consolidated by Shri Guruji M.S. Golwalkar after 1940, sees itself as the legatee of this heroic tradition. It believes in the principle of: \"Justice for all and appeasement of none\". It has no doubt about Hindu identity and culture being the mainstay of the Indian nation and of Indian society. This identity and this culture informs all Indians, irrespective of religious or denominational faith. To the RSS, all Indians, irrespective of religious background, notwithstanding their mode and place of worship, are equal.', 'Ideologue and Teacher Pandit Deendayal Upadhyaya (1916-1968) Pandit Deendayal Upadhyaya was the leader of the Bharatiya Jana Sangh from 1953 to 1968. A profound philosopher, committed organization man and a leader who who maintained the highest standards of personal integrity and dignity in public life, he has remained a source of ideological guidance and moral inspiration for the BJP since its inception. His treatise Integral Humanism is a critique of both communism and capitalism. It provides a holistic alternative perspective for political action and statecraft consistent with the needs of the human race and the sustainability of our natural hab itat. A Short Biography Pandit Deendayal Upadhyaya was born on September 25, 1916, in the sacred region of Brij  in the village of Nagla Chandraban in Mathura, in what is now Uttar Pradesh. An astrologer who studied his horoscope predicted that the boy would become a great scholar and thinker, a selfless worker, and a leading politician - but that he would not marry. Deendayalji experienced tragedy in his early years, losing his brother to illness in 1934. He later went to high school in Sikar (now in Rajasthan) where he excelled.\r\n\r\nThe then Maharaja of Sikar awarded Pandit Upadhyaya a gold medal, Rs. 250 for books and a monthly scholarship of Rs.10. Deendayalji passed his Intermediate exams with distinction in Pilani and left for Kanpur to pursue his B.A. and joined the Sanatan Dharma College. At the instance of his friend, Shri. Balwant Mahashabde, he joined the RSS in 1937. In the same year, he received his B.A. in the first division. Deendayalji then moved to Agra to pursue an M.A.', 'As a leader of Opposition in the Council, Nitin Gadkari was never observed as lagging behind in raising the issues of public interest. As a true democrat and fiery orator he made it a point to remain present in the House and take part in the proceedings during the business sessions. He was always proactive in exposing the lapses of the government on various issues of public interest. He was corrective and suggestive in his criticism and all his criticism was embedded in profound concern for the welfare of the people. He raised as many as over 5000 queries through starred and un-starred questions and call attention motions in the House. He developed a style of taking all the members of Opposition with him irrespective of party or ideological affiliations in the House.<br><br>Nitin Gadkari has a magnetic personality. Even his adversaries on the treasury benches appreciate his sincerity and commitment in a most friendly manner. His book Sabhapati Mahodaya which depicts his select speeches in the house reflects his concerns for issues cutting across the wide spectrum of society.', 'Bharatiya Janata Party', 'http://www.bjp.org/', 13, '0000-00-00 00:00:00', NULL, '13-1441971197-pbanner.jpg', '13-1441971197-hsbanner.jpg', '13-1441971197-phbanner.jpg'),
(5, 'ENG', 'The Bharatiya Janata Party is today the most prominent member of the family of organisations known as the \"Sangh Parivar\" and nurtured by the Rashtria Swyamsevak Sangh (RSS). Like the RSS, the BJP is wedded to Indias unity and integrity, its intrinsic identity and the social strength, individual character and cultural uniqueness that have been the hallmark of this great country and its people for millennia.\r\nHistory is the philosophy of nations. And the Sangh Parivar has a very clear and clear conception of Indian history. Here was a great civilization whose influence and imprint spread from Sri Lanka to Tibet, from Southeast Asia to Central Asia, from one end of the Indian Ocean to the other. It weathered the storms of invaders, from the Greeks to the Huns, from the Shakas to the Islamic armies of Turks and Afghans. It fought and resisted external oppression and its essential civilization and culture survived great challenges and attempts at effacement. The glory of Vijayanagara and the heroism of Maharana Pratap, of a Shivaji and of a Guru Govind Singh are testimony to the Indian spirit.\r\n\r\nIn more recent times this torch of nationalism and Indian identity was carried forward by Swami Dayanand and Swami Vivekanada. And in the present century the good work has been carried on by Sri Aurobindo, Lokmanya Tilak, Mahatma Gandhi and others. The RSS, founded by Dr K.B. Hedgewar in 1925 and consolidated by Shri Guruji M.S. Golwalkar after 1940, sees itself as the legatee of this heroic tradition. It believes in the principle of: \"Justice for all and appeasement of none\". It has no doubt about Hindu identity and culture being the mainstay of the Indian nation and of Indian society. This identity and this culture informs all Indians, irrespective of religious or denominational faith. To the RSS, all Indians, irrespective of religious background, notwithstanding their mode and place of worship, are equal.', 'Hindutva or Cultural Nationalism presents the BJP\'s conception of Indian nationhood. It must be noted that Hindutva is a nationalist, and not a religious or theocratic, concept. An article by Shri Arun Shourie, in the wake of what has come to be known as the Hindutva Judgement by the Supreme Court, put the concept in greater detail.\r\nLeadership of BJP:\r\n1.	Shri Atal Bihari Vajpayee\r\n2.	Shri LK Advani\r\n3.	Shri Rajnath Singh\r\n4.	Shri Narendra Modi\r\n5.	Shri Late Pramod Mahajan\r\n6.	Shri Amit Shah\r\n7.	Brij Mohan Agarwal\r\n\r\nHe fought to decrease the gap between the upper and lower class of society for the economic and the overall development of the state. Some major works include removing the barriers of class, community and religion in the society. He has also done many social activities like providing fund for the development of health and education of poor children, helping in marriage of girls from poor families. He was agriculture minister of Chhattisgarh also handled many other departments earlier which includes Public Works Department, Endowment, School Education, Culture, Tourism etc.', '<p class=\"MsoNormal\">He fought to decrease the gap between the upper and lower\r\nclass of society for the economic and the overall development of the state.\r\nSome major works include removing the barriers of class, community and religion\r\nin the society. He has also done many social activities like providing fund for\r\nthe development of health and education of poor children, helping in marriage\r\nof girls from poor families. He was agriculture minister of Chhattisgarh also\r\nhandled many other departments earlier which includes Public Works Department,\r\nEndowment, School Education, Culture, Tourism etc.</p>', 'Bharatiya Janata Party', 'http://www.bjp.org/', 16, '0000-00-00 00:00:00', NULL, '16-1442231067-pbanner.jpg', '16-1442231067-hsbanner.jpg', '16-1442231067-phbanner.jpg'),
(6, 'ENG', 'The Bharatiya Janata Party is today the most prominent member of the family of organisations known as the \"Sangh Parivar\" and nurtured by the Rashtria Swyamsevak Sangh (RSS). Like the RSS, the BJP is wedded to Indias unity and integrity, its intrinsic identity and the social strength, individual character and cultural uniqueness that have been the hallmark of this great country and its people for millennia. History is the philosophy of nations. And the Sangh Parivar has a very clear and clear conception of Indian history. Here was a great civilization whose influence and imprint spread from Sri Lanka to Tibet, from Southeast Asia to Central Asia, from one end of the Indian Ocean to the other. It weathered the storms of invaders, from the Greeks to the Huns, from the Shakas to the Islamic armies of Turks and Afghans. It fought and resisted external oppression and its essential civilization and culture survived great challenges and attempts at effacement. The glory of Vijayanagara and the heroism of Maharana Pratap, of a Shivaji and of a Guru Govind Singh are testimony to the Indian spirit. rashtriya swayamsewak sangh, rss logoIn more recent times this torch of nationalism and Indian identity was carried forward by Swami Dayanand and Swami Vivekanada. And in the present century the good work has been carried on by Sri Aurobindo, Lokmanya Tilak, Mahatma Gandhi and others. The RSS, founded by Dr K.B. Hedgewar in 1925 and consolidated by Shri Guruji M.S. Golwalkar after 1940, sees itself as the legatee of this heroic tradition. It believes in the principle of: \"Justice for all and appeasement of none\". It has no doubt about Hindu identity and culture being the mainstay of the Indian nation and of Indian society. This identity and this culture informs all Indians, irrespective of religious or denominational faith. To the RSS, all Indians, irrespective of religious background, notwithstanding their mode and place of worship, are equal.', 'Ideologue and Teacher Pandit Deendayal Upadhyaya (1916-1968) Pandit Deendayal Upadhyaya was the leader of the Bharatiya Jana Sangh from 1953 to 1968. A profound philosopher, committed organization man and a leader who who maintained the highest standards of personal integrity and dignity in public life, he has remained a source of ideological guidance and moral inspiration for the BJP since its inception. His treatise Integral Humanism is a critique of both communism and capitalism. It provides a holistic alternative perspective for political action and statecraft consistent with the needs of the human race and the sustainability of our natural hab itat. A Short Biography Pandit Deendayal Upadhyaya was born on September 25, 1916, in the sacred region of Brij  in the village of Nagla Chandraban in Mathura, in what is now Uttar Pradesh. An astrologer who studied his horoscope predicted that the boy would become a great scholar and thinker, a selfless worker, and a leading politician - but that he would not marry. Deendayalji experienced tragedy in his early years, losing his brother to illness in 1934. He later went to high school in Sikar (now in Rajasthan) where he excelled. The then Maharaja of Sikar awarded Pandit Upadhyaya a gold medal, Rs. 250 for books and a monthly scholarship of Rs.10. Deendayalji passed his Intermediate exams with distinction in Pilani and left for Kanpur to pursue his B.A. and joined the Sanatan Dharma College. At the instance of his friend, Shri. Balwant Mahashabde, he joined the RSS in 1937. In the same year, he received his B.A. in the first division. Deendayalji then moved to Agra to pursue an M.A.\r\n\r\nColonel Rajyavardhan Singh Rathore is an Veteran Indian shooter and politician (union minister), who rose to fame after winning the Silver Medal in Men\'s Double Trap at the 2004 Summer Olympics in Athens. He is the first sportsperson to win individual Silver for India since Norman Pritchard, who won two Silver Medals at the 1900 Paris Olympics. Rathore hails from Jaisalmer, Rajasthan.\r\nRathore graduated from the National Defence Academy, and since served in the Indian Army where he retired as a Colonel in 2013, before joining politics. \r\n', 'On 10 September 2013, Rathore joined Bharatiya Janata Party after taking voluntary retirement from the Indian Army. He was elected as a MP in the 2014 Lok Sabha election from Jaipur Rural constituency. On 9 November 2014, he was sworn-in as the Minister of State for Information & Broadcasting, under the Narendra Modi government.   Achievements  	1989- Blazer (Highest sports award at the National Defence Academy, Pune, India). 	1990 - Sword of Honour (For the Best All Round Officer Cadet at the Indian Military Academy). 	1990 - Sikh Regiment Gold Medal (For the Best Sportsmen at the Indian Military Academy). 	2004-2005 - the Rajiv Gandhi Khel Ratna (Highest Sporting Honour of India). 	2003-2004 - Arjuna Award 	Rathore is a recipient of the Padma Shri, a civilian award from the Government of India 	Ati Vishisht Seva Medal (AVSM), military award for exceptional service, presented by the President of India on behalf of the Government of India. 	Rathore was the chosen flag bearer for India during the 2008 Summer Olympics in Beijing, China. 	Rathore was the chosen flag bearer for India during the 2006 Commonwealth Games in Melbourne, Australia', 'Bharatiya Janata Party', 'http://www.bjp.org/', 18, '0000-00-00 00:00:00', NULL, '18-1442235315-pbanner.jpg', '18-1442235315-hsbanner.jpg', '18-1442235315-phbanner.jpg'),
(7, 'ENG', 'The Bharatiya Janata Party is today the most prominent member of the family of organisations known as the \"Sangh Parivar\" and nurtured by the Rashtria Swyamsevak Sangh (RSS). Like the RSS, the BJP is wedded to Indias unity and integrity, its intrinsic identity and the social strength, individual character and cultural uniqueness that have been the hallmark of this great country and its people for millennia.\r\n\r\nHistory is the philosophy of nations. And the Sangh Parivar has a very clear and clear conception of Indian history. Here was a great civilization whose influence and imprint spread from Sri Lanka to Tibet, from Southeast Asia to Central Asia, from one end of the Indian Ocean to the other. It weathered the storms of invaders, from the Greeks to the Huns, from the Shakas to the Islamic armies of Turks and Afghans. It fought and resisted external oppression and its essential civilization and culture survived great challenges and attempts at effacement. The glory of Vijayanagara and the heroism of Maharana Pratap, of a Shivaji and of a Guru Govind Singh are testimony to the Indian spirit.\r\n', 'In more recent times this torch of nationalism and Indian identity was carried forward by Swami Dayanand and Swami Vivekanada. And in the present century the good work has been carried on by Sri Aurobindo, Lokmanya Tilak, Mahatma Gandhi and others. The RSS, founded by Dr K.B. Hedgewar in 1925 and consolidated by Shri Guruji M.S. Golwalkar after 1940, sees itself as the legatee of this heroic tradition. It believes in the principle of: \"Justice for all and appeasement of none\". It has no doubt about Hindu identity and culture being the mainstay of the Indian nation and of Indian society. This identity and this culture informs all Indians, irrespective of religious or denominational faith. To the RSS, all Indians, irrespective of religious background, notwithstanding their mode and place of worship, are equal.', 'Narendra Modi', 'BJP', 'http://www.bjp.org/', 23, '0000-00-00 00:00:00', NULL, '23-1450174732-pbanner.jpg', '23-1450174732-hsbanner.jpg', '23-1450174732-phbanner.jpg'),
(8, 'ENG', 'The Bharatiya Janata Party is today the most prominent member of the family of organisations known as the \"Sangh Parivar\" and nurtured by the Rashtria Swyamsevak Sangh (RSS). Like the RSS, the BJP is wedded to Indias unity and integrity, its intrinsic identity and the social strength, individual character and cultural uniqueness that have been the hallmark of this great country and its people for millennia.\r\n\r\nHistory is the philosophy of nations. And the Sangh Parivar has a very clear and clear conception of Indian history. Here was a great civilization whose influence and imprint spread from Sri Lanka to Tibet, from Southeast Asia to Central Asia, from one end of the Indian Ocean to the other. It weathered the storms of invaders, from the Greeks to the Huns, from the Shakas to the Islamic armies of Turks and Afghans. It fought and resisted external oppression and its essential civilization and culture survived great challenges and attempts at effacement. The glory of Vijayanagara and the heroism of Maharana Pratap, of a Shivaji and of a Guru Govind Singh are testimony to the Indian spirit.\r\n', 'In more recent times this torch of nationalism and Indian identity was carried forward by Swami Dayanand and Swami Vivekanada. And in the present century the good work has been carried on by Sri Aurobindo, Lokmanya Tilak, Mahatma Gandhi and others. The RSS, founded by Dr K.B. Hedgewar in 1925 and consolidated by Shri Guruji M.S. Golwalkar after 1940, sees itself as the legatee of this heroic tradition. It believes in the principle of: \"Justice for all and appeasement of none\". It has no doubt about Hindu identity and culture being the mainstay of the Indian nation and of Indian society. This identity and this culture informs all Indians, irrespective of religious or denominational faith. To the RSS, all Indians, irrespective of religious background, notwithstanding their mode and place of worship, are equal.', 'Narendra Modi', 'BJP', 'http://www.bjp.org/', 23, '0000-00-00 00:00:00', NULL, '23-1450174763-pbanner.jpg', '23-1450174763-hsbanner.jpg', '23-1450174763-phbanner.jpg'),
(9, 'ENG', 'The Indian National Congress (INC, often called the Congress), is one of the major political parties in India. Congress is one of the largest and oldest democratically run political parties in the world. The party was founded in 1885 during the British Raj; its founders include Allan Octavian Hume (a prominent member of the Theosophical Society), Dadabhai Naoroji and Dinshaw Wacha. In the late nineteenth and early to mid-twentieth centuries, Congress became a pivotal participant in the Indian Independence Movement, with over 15 million members and over 70 million participants in its opposition to British colonial rule in India.\r\n\r\nAfter independence in 1947, Congress became India\'s dominant political party; as of 2015, in the 15 general elections since independence, it has won an outright majority on six occasions and has led the ruling coalition a further four times, heading the central government for 49 years. There have been seven Congress Prime Ministers, the first being Jawaharlal Nehru (194764), and the most recent Manmohan Singh (200414). The party\'s social liberal platform is generally considered to be on the centre-left of Indian politics.[13]\r\n\r\nFrom 2004 to 2014, the Congress-led United Progressive Alliance, a coalition of several regional parties, formed the Indian government and was headed by Prime Minister Manmohan Singh. In November 2014, the party was in power in ten states and had a majority in six  Arunachal Pradesh, Himachal Pradesh, Karnataka, Manipur, Meghalaya and Mizoram. In Assam, Kerala and Uttarakhand it shared power with its alliance partners. The Congress has previously directly ruled Andhra Pradesh, Tamil Nadu, Gujarat, Madhya Pradesh, Rajasthan, Punjab and Goa.', 'Article I - INC Constitution\r\n\r\nThe object of the Indian National Congress is the well-being and advancement of the people of India and the establishment in India, by peaceful and constitutional means, of a Socialist State based on Parliamentary Democracy in which there is equality of opportunity and of political, economic and social rights and which aims at world peace and fellowship.\r\n\r\nAllegiance to Constitution of India, Article II - INC Constitution\r\n\r\nThe Indian National Congress bears true faith and allegiance to the Constitution of India as by law established and to the principles of socialism, secularism and democracy and would uphold the sovereignty, unity and integrity of India.', '1.	Smt. Sonia Gandhi&nbsp;<div>2.	Shri Rahul Gandhi&nbsp;</div><div>3.	Dr Manmohan Singh&nbsp;</div><div>4.	Tarun Gogoi&nbsp;</div><div>5.	Prithviraj Chavan</div>', 'Indian National Congress', 'http://inc.in/', 26, '0000-00-00 00:00:00', NULL, '26-1454054016-pbanner.png', '26-1453898039-hsbanner.jpg', '26-1453898039-phbanner.png'),
