(12, 'ENG', 'The Bharatiya Janata Party is one of the two major political parties in India, along with the Indian National Congress, it is the country\'s largest political party in terms of representation in the national parliament and state assemblies and is the world\'s largest party in terms of primary membership. BJP is a right-wing party, and its policy has historically reflected Hindu nationalist positions.[14][22] It has close ideological and organisational links to the Rashtriya Swayamsevak Sangh', 'Party Philosophy: Desc', 'Sunil Mandhe', 'Bharatiya Janata Party', 'https://en.wikipedia.org/wiki/Bharatiya_Janata_Party', 51, '0000-00-00 00:00:00', NULL, NULL, NULL, NULL);
