(26, 'Shasyed Fakir', '9577525419', 'Sir,\nIn the present scenario my suggestion is to hold several meeting with club members at constituency level / block level/ panchayat level becoz club members are active and energetic force. They can be d game changer. Actually they are now decesion maker of a family. If we can convince one member, it means a family is convinced.\n1 member  4 votes: 10 members = 1 club  40 votes: 40 club  1600 votes thus the multiplier effect will work....', 26, 207, '2016-03-25 07:21:42'),
