(35, 'Manash kakati', '9954141451', 'Respected Sir\nmoi Congress r ejon niswartho kormi. 2004 t moi Morigaon DYCC Secretary asilu.aru xoru re pora NSUI aru Youth congress kori ahisu. 2006 bohut kosto kori Bibek Doloi da k jikaisilu.moi Jagiroad town t okole vote collection kori silu aru bohutu jubok jubotik congress loi aniboloi xokhyom hoisilu. jitu Bibek da u swikar korisil. kintu 2006 t jikar pisore pora teu amar karone eku nokorile,kunu kam nidile. mur joriyote congress loi aha kunu lorake eku xubidha nidile ,kewol nijor poriyal aru kisu dalal srenir manuhok Roja bonale. jar folot aji xei lorabur BJP loi dhal kai gusi gol.  Pijush ye jagiroad r 80% young lorak toka poisa aru time di nijor foliya kori loise. aji xi anytime jagiroad bahor pati gutei loraburor logot eke loge khana khai holi kheli , biya ye xobahe goi soboke nijor kori pelale. kintu Bibek da ye aamar dore pokrito kunu congress ye lora eta khobr u noloi.jar folot amar monubol vangi goise. moi aru mur logor khini mur ghoror manuh xokolu Congress e. ami nomoraloi ke congress korim. \nBibek da r bortoman xomostit bor bhal nahoi sir. teu jodi anekei thake tente nisshoy haribo. jodi teu purona deka lora suwali burok byoktigoto vabe log dhori ba ph kori khobr loy aru antorikota dexuwai tente nisshoy xufol pabo.aru ami xokoluwe monor dukh xukh pahori natun uddomere juji Congress r hat xokotikhali koribo parim buli mur bisshKh. sradhar sir plz???? Jagiroad xomostit alop gurutto diyok nahole Xomostitu Pijush r dore eta gunda khistasar nothoka udondo lorar hatoloi jabo. jiye aamak bohut manoxik kosto dibo aru Jagiroad baxi raijok onagoto 5 years jolai khabo. nijor gunda girire aru sendicate rajere. xeye sir aapunaloi bohut bohut onurudh thakil jen aapuni mur dore ejon pokrito congressi lorar monor bedona buje aru bihito bebosta loy.\n\nkhekhot bohut bohut srodhare aapunar bisshaki \nManash kakati\nJagiroad.\n9954141451', 26, 313, '2016-03-25 11:22:37'),
