(38, 'salim ahmed', '8876559660', 'For a healthy living state, country and the world 5 points are true\n\n1. sustainable development\n\n2. population control\n\n3. humans are social amimals. excess techlonogy leading imbalance one to one social talks; sleep disorders and stress management.\n\n4. green revolution, spirituality from west , middle-east and east (1,2,3 test)\n\n5. HRM , human skin colour, (geographic distribution of UV radiation (UVR) and the distribution of indigenous skin pigmentation, melanin at equator); recent african origin of modern human species theories (DNA sampling) .\n\n6. attachment\n\nhttp://www.ramsdale.org/migrate.gif\n\nhttps://en.wikipedia.org/wiki/Recent_African_origin_of_modern_humans\n\nhttps://en.wikipedia.org/wiki/Human_skin_color\n\nregards', 26, 321, '2016-03-25 12:59:05'),
(39, 'salim ahmed', '8876559660', 'For a healthy living village state, country & world 5 point table is great viz\n\n1. sustainable development\n\n2. population control\n\n3. humans are social amimals. excess techlonogy leading imbalance one to one social talks; sleep disorders and stress management.\n\n4. green revolution, spirituality from west , middle-east and east (1,2,3 test)\n\n5. HRM , human skin colour, (geographic distribution of UV radiation (UVR) and the distribution of indigenous skin pigmentation, melanin at equator); recent african origin of modern human species theories (DNA sampling) .\n\n6. attachment\n\nhttp://www.ramsdale.org/migrate.gif\n\nhttps://en.wikipedia.org/wiki/Recent_African_origin_of_modern_humans\n\nhttps://en.wikipedia.org/wiki/Human_skin_color\n\nregards', 26, 321, '2016-03-25 13:00:46'),
(40, 'Rupak Gupta', '9678110072', 'We ll be back again sir, people of assam are with us, INC zindabad', 26, 322, '2016-03-25 13:22:04'),
(41, 'NayanJyoti Baishya', '8254855552', 'Sir Namaskar,\n\nMor nam NayanJyoti Baishya. Moi aponar baxasthan Kainadharar pora  matra 2 kilometer atarar Dakhin-Pashim dixe thaka Patorkuchi gaonr baxinda.\n\nAti dukhar bixaije aponar 15 basariya gourabujjal shaxan kalsowa samayat Patarkuchi-Kanadhara xangjogi pathti eti KESA ali hisape roi gol aru barixakali Kainadhara paharar para nami aha paniye sristi kara krittim banpani xamshytiro kuno xamadhan sutrar diha kara nahal.\n\nAponar mantri xabhar antargato tatha Dispur xamastir MLA mananiyo Shreejut Akon Bora dangariya deveo tekhatar 10 basariya karjyakal xamaychowat ei bixaytir oparat kuno bihita bebastha grahan nakarile sthaniyo raijar hitarthe.\n\nAmar bishash, aapuni aamar ei xamashya dutir anta pelabaloi shighrei karjyakari howakoi ek usit bebastha grahan karibo xamuh Patarkuchibaxi raijar mukhat hahi biringabalai.\n\nShradhya aru bishaxere\nNayanJyoti Baishya\nAlok Nagar, Byelane 12,\nPatarkuchi, Basistha.', 26, 316, '2016-03-25 13:51:02'),
(42, 'EKRAMUL ISLAM', '9957105699', 'SIR LAHARIGHAT TOR KHABOR BAL', 26, 319, '2016-03-25 15:45:03'),
