(78, 'Shankar Hazarika', '9435106369', 'R.E: Appel for Notifications, implementation\n of the \'State Govt. Health Scheme\' as\n already announced long back and\n Release of 6 % Additional D.A as was\n recently released to the Central Govt.\n Employees/Pensioners by the GoI and\n Grant of family pension benefit to the\n disabled dependant son/daughter of \n the State Govt. Pensioners, at par with\n Central Govt Employees/Pensioners,\n implemented long back after bringing\n Amendments to the CSS (Pension)\n Rules, 1972, Rule 54 - Family Pension. \n\nHon\'ble Chief Minister of Assam,\n\n That Sir, as the Hon\'ble Chief Minister of Assam, you have always thought about the welfare measures and accordingly done enough for the State Govt. Employees/Pensioners, by bringing them at par, with the Central Govt the Employees/Pensioners in the last 15 years and for this we are ever grateful to you Sir. \n The only appeals remaining to our respected C.M, are the three vital issues concerning the Employees now pending, are the Notifications and implementation, pertaining to the following issues - \n\n(1) The \'State Govt. Health Scheme\' as already announced long back, to be at par with Central Govt. Employees/Pensioners ! \n\n(2) Release of 6 % Additional D.A as was recently released to the Central Govt. Employees/Pensioners by the Govt of India !\n\n(3) Grant of family pension benefit to the7 disabled dependant son/daughter of the State Govt. Pensioners, at par with Central Govt. Employees/Pensioners, implemented long back after bringing Ammendments to the CSS (Pension) Rules, 1972, Rule 54 - Family Pension, vide the GoI\'s Notifications Dt.28.12.2012, Dt.16.1.2013 & Dt.1.7.2013, to give the much needed relief to \'Persons with Disabilities\', by implementing the provisions of \'Persons with Disability Act, 1995\' and its leap forward to the \'Persons with Disabilities (Amendment) Bill, 2014\', now pending in Parliament for Legislation during ensuing Sessi', 26, 440, '2016-03-30 09:09:18'),
