(127, 'Pritesh', '8806781153', 'Hello,\n\nto the person who is handling this account, I request you to please read the message carefully and pass on my message to Mr. MLA.\n\nDear MLA sir,\n\nThis app is a good initiative to reach your voters and showcase your work, but it\'s just showing photo operations and nothing. Please elaborate the development work done in your area, specify the problems of people which you resolved. Highlight the work you done for betterment of residents in your area.\n\nAnd last, you can not reach to everyone\'s doorstep to know their problem; people have to come forward and tell you so my suggestion is that add a function of complaint/request in this app itself so that a person who is busy in office 12-14 hours can contact you and submit his/her problem to you via this app.\n\nI strongly feel that message will reach you and you will think of it.\n\nwith best regards\nPritesh', 29, 542, '2016-05-17 04:47:59'),
(128, 'S Moyong', '9707010170', 'Dear Koka,\nTomorrow the luck box will decide the faith of next director of assam. i still belief, this year again you will be back to lead my state and us. yes, i have not personally benefited from you and your govt. but my village and state peoples have benefited from your visionaries. Am happy to get you as my CM and one of the finest CM and a visionary of my land. you have faced ever odds and gave your beat. What will be tomorrows result, is not my concern. I admit, till date you are the best CM i have seen and found in my life. May god keep you healthy and power to lead us.', 26, 543, '2016-05-18 18:12:33'),
(129, 'Motiur Rahman', '7086047002', 'Insuallah you to be the CM For 4th time as per my exit poll.\n\nGOOD LUCK.', 26, 463, '2016-05-18 20:01:21'),
