(13, 'ENG', 'Education', '1.	Pardhi Samaj Adivasi Ashram Shala, Khamgaon (Residential school for Children Of Paradhi Community) \r\n\r\n2.	Suryoday AIDS Foundation (Residential care center for HIV Children) \r\n\r\n3.	Bhartiya Sanskrutic Gyan Mandir School, Sangola (Residential school for Backward Class Children) \r\n\r\n4.	Dhartiputra Gnyan Prabodini, Dhar School (Non residential School for Children of Farmers) \r\n\r\n5.	Suryoday Scholarship program (To promote education and support the BPL families) \r\n\r\n6.	Scholarships for the Children of Prisoners (To Support Prisoners children) \r\n\r\n7.	Suryoday Constitution Awareness Program (A campaign to make aware all civilians about their rights and responsibilities) \r\n\r\n8.	Balgram Yojna (To instill the importance nature in children and to support them in education) \r\n\r\n9.	Suryoday Sanskar evam Kala Krida Prabodhini -(Summer Camps for Children to inculcate the moral vales and importance of physical fitness) \r\n\r\n10.	Suryoday Higher Education Program (To Provide help and support for the aspirants of higher education programs) \r\n\r\n11.	Sammishra Shala (A school for Physically and Mentally Challenged Children)', 32, '2016-06-17 14:53:24', '32-1466175204-plogo.jpg', NULL),
(15, 'ENG', 'Agriculture', '1. Suryodaya Jal Sandharan &amp; Sanrakshan Abhiyan (Water Conservation Scheme)\r\n\r\n2. Dharti Putra Sewa Abhiyan (A campaign to solve all kinds problems of farmers &amp; to prevent them form suicides)\r\n\r\n3. Bhoomi Sudhar Abhiyan (A campaign to enhance the soil fertility and providing them knowledge of organic farming and other modern farming techniques)      \r\n\r\n4. Krishi Teerth (An Information center for farmers to provide all farming related information, solution, and guidance to increase the production)\r\n\r\n5. Seed Distribution to Farmers (Free Seed Distribution)\r\n\r\n6. Suryoday Model Village, Kapileshwar (An Ideal village to make it self dependent  and with all modern facilities like Solar energy generators, Bio-Gas Based Captive Power Generation Cum Composting  Plant, Self help groups to promote self employment)\r\n\r\n7. Soil and Water Testing Labs (To provide information and solution related to soil and water to farmers)  \r\n\r\n8. Tankar Free Village (A campaign run in drought prone area to solve the water crises in villages)\r\n\r\n9. Agricultural Equipment Park\r\n\r\n10. Non-Conventional Energy Park\r\n\r\n11. Indrashay Yojna\r\n', 32, '2016-06-17 15:20:00', '32-1466176800-plogo.jpg', NULL),
(16, 'ENG', 'Social', '1. Shavdah Yojna (Performing last rite of orphan dead bodies) \r\n\r\n2. Jeevdaya Abhiyan (Medical Help for injured Stray Animals, Providing food and Water to Animals and Birds)\r\n\r\n3. Sheet Ritu Manvta Seva Abhiyan (Blanket Distribution Campaign to protect pores form biting cold) \r\n\r\n4. Rehabilitation of Prisoners\r\n\r\n5. Computer Centers and Library in Jails \r\n\r\n6. Annaksetra Yojna\r\n\r\n7. Suryoday Kanya Dan Yojna (Community Marriage)\r\n\r\n8. Suryoday Kanya Brhoon Sanrakshan Yojna (To bring the awareness and preventing people form female infanticide)\r\n\r\n9. Social Help Scheme - (Providing job placements to Unemployed Youth)   \r\n\r\n10. Goshala \r\n\r\n11. Suryoday Adhar Yojana (Medical facilities for  senior citizens at their door steps in nominal charges)  \r\n\r\n12. Jijau Swabhiman Mahotsav (Kanya Burn hatya Nirmulan) \r\n\r\n13. Suryoday Sneh Aadhar Yojna (Residential Care Center for orphan Mentally Retarded Woman)\r\n\r\n14. Matoshri Vuridhasharam, Tuljapur (Old Age Homes)\r\n\r\n15. Suryoday Manavta Sewa Puraskar (The trust honors the social workers to encourage the humanitarian work and efforts among society)\r\n\r\n16. Sarva Dharma Sambhav Seva Program ( An initiative for national integrity in which the trust invite all religious Gurus and share their religious teachings )   \r\n\r\n17. Rehabilitation of Devdasi and Bachda Samaj\r\n\r\n18. Rehabilitation of Terrorism affected families\r\n\r\n19. Institute of Social Re engineering\r\n\r\n20. Rehabilitation Center for Transgender people  \r\n', 32, '2016-06-17 15:22:31', '32-1466176951-plogo.jpg', NULL),
(17, 'ENG', 'Environmental', '1. Rashtra Chetna Paryawaran Mahayagya (For reducing the pollution and providing homage to mother nature)\r\n\r\n2. Plantation Scheme (An initiative for preventing  our mother earth form global warming)   \r\n\r\n3. Teerthkshtra Swachta Abhiyan\r\n\r\n4. Energy Park (To create the awareness about various alternate technologies available for power generation at the farmers backyard Model of various non-conventional energy sources are demonstrated in Rishi Sankul)\r\n\r\n5. Harit Teerth Yojana (Plantation at all sacred places)\r\n', 32, '2016-06-17 15:44:57', '32-1466178297-plogo.jpg', NULL),
(18, 'ENG', 'Health', '1. Suryoday Health Camp Scheme\r\n\r\n2. Swasthya Arya Kuposhan Unmulan Yojna (Campaign for villagers affected form malnutrition) \r\n\r\n3. I.C.C.U. on Wheels - (Providing  Medical Help to accident victims on roads) \r\n\r\n4. Medicinal Plant Farming\r\n\r\n5. Hearing aids for Hearing Impaired\r\n\r\n6. Gymnasium, Murta Horti\r\n', 32, '2016-06-17 15:37:59', '32-1466177879-plogo.jpg', NULL),
(19, 'ENG', 'NATIONAL INTEGRITY', '1. Bharat Mata Mandir .<div>2. Vande Matram Nation Foundation &nbsp;</div><div>3. Renovation of Monuments and Mosques\r\n</div>', 32, '2016-06-17 15:40:02', '32-1466178002-plogo.jpg', NULL);
